(19, '2018-12-30', '11:20:28', 30, 12, 2018, 'Kick Start the New Year with Top New Year Party Destinations in India', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Want to Welcome the New Year in style? Then here are some exciting places you need to know.</p><h2 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Top New Year Party Destinations in India:</span></h2><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Goa</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In Goa, head to Anjuna Beach for some awesome all-night parties. Kamaki in Baga could be a good option too with the ritzy Mambos and Titos. Indulge in pool side parties at Candolim or head to Grand Hyatt at Panjim. For family parties, go to Cohiba at Candolim.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Gulmarg</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Gulmarg offers you some awesome retreats. Indulge in New Years parties at Heevan Retreat or Hotel Grand Mumtaz. You can also enjoy Gondola Ride at Gulmarg or drive around the Outer Circle Walk in the city.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Kutch</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Kutch witnesses Rann Utsav, a carnival of music and dance. This year, the event is being celebrated from 1st November 2018 to 20th February 2019.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Mumbai</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The top places are Lotus Caf at JW Marriott, Stax at Hyatt Regency, Amnesia at LIV, Visa on Arrival at Canvas Lounge, Hot Freeze at The Westin and The VVIP Experience at Ghost.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Delhi:</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Smaaash Carnival at DLF Mall of India, Hard Rock Caf in Gurugram and The Umrao are among the top places to party. You can also visit hubs like Connaught Place and Hauz Khas village as they offer a plethora of cafes and bars to choose from.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Bangalore</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Head to Leela Kempinski, Dugout Rooftop Restaurant and Sports Bar, F Bar &amp; Kitchen or Sutra at Hotel Lalit Ashok.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Manali</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The celebrations at Morpheus Valley Resort, Solang Valley or Rohtang Pass will ensure a joyous start to the next year.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Kerala</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Indulge in any of the parties at Holiday Inn, Crowne Plaza, Ramada Resort Cochin, Le Meridien, The Raviz Hotels &amp; Resorts or Windsor Castle.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Jaipur</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Choki Dhani, ITC Rajputana and other royal resorts in the city offer an ethereal experience. For party enthusiasts, there are various pubs in Jaipur that organize happening New Year bashes.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Mcleodganj</span>:</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Head to places like Shiva Cafe, Peace Caf or Coffee Talks to kick start the New Year.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', 'new.jpg', '1', '1546149028', 'Latest_News', '', '', 'Admin', '1'),
(20, '2018-12-30', '11:21:10', 30, 12, 2018, 'Centre Doubles Export Incentives for Onion Farmers', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The Government has increased the export incentives granted for Onions. It has been increased under the Merchandise Exports from India Scheme (MEIS) from existing 5% to 10% in the interest of farmers.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It will result in better price for Onion in domestic markets. Not to forget that, the onion arrivals have increased in the market at present. It is the reason due to which the prices in the Mandis are subdued.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Now it has been decided by the Government to encourage exports of Onions so that the domestic prices stabilize. Therefore, the export incentives for Onions have been doubled to 10% from what is being currently provided under MEIS scheme.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Before July 2018, the export incentive for fresh inions was zero. During July, 2018, the incentives were introduced at the rate of 5%. Now, with the current increase, Onions enjoy one of the highest incentives for Agro-exports.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">This timely intervention would help the farmers who have recently harvested their produce, sowed or recently transplanted their seeds, expecting better prices.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '2.jpg', '1', '1546149070', 'Latest_News', '', '', 'Admin', '1'),
(21, '2018-12-30', '11:21:49', 30, 12, 2018, 'BASIX Help Government School Students to Learn About Horticultural Produce Marketing', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">BASIX an Academy for Building Lifelong Employability Limited (B-ABLE ), has recently made government school students learn about horticultural produce marketing at Ambiance Mall Gurgaon on 26 Dec 2018.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The government school students are from Rohtak. They visited Ambiance Mall Gurgaon where Vocational trainer from Basix Academy guided them on learning and industries connect.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It will help students in learning beyond their regular courses in school. Education about farm skills can help rural India to develop.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11885/am3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11883/am1.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11884/am2.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Interestingly, the government of Haryana is supporting and funding the program under NSQF initiative of government of India.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">BASIX Social Enterprise Group, was established in 2009, with a vision of skilling people, enhancing livelihoods and transforming lives. B-ABLE is a pioneer organization in the field of skill development and vocational training with distinction of being first training partner of National Skills Development Corporation (NSDC).</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It has implemented training programs across 28 states of India in various sectors including construction, apparel, textile, retail, hospitality, agriculture, health, automobile, ITES, etc.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The primary goal of this programme is Vocationalisation of Secondary Education by incorporating employability as well as entrepreneurial training into School Education. The vision of the scheme corresponds with B-ABLEs goal to make the students sufficiently productive so that they can have relevant skills (as per the demand of the current market) which can make them employable after completion of their secondary education.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The programme is implemented by a Vocational Training Partner (VTP). B-ABLE is one of the oldest and a major VTP.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '3.png', '1', '1546149109', 'Latest_News', '', '', 'Admin', '1'),
(22, '2018-12-30', '11:22:28', 30, 12, 2018, 'PM Modi Provides $42.82 billion & Loan Forgiveness Program to Aid Farmers Hit by Low Crop Price', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Prime Minister Narendra Modi is out with a big plan to help farmers suffering by low crop prices.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">PM has considered three options for a relief package to help farmers suffering of low crop prices at a cost of as much as 3 trillion rupees ($42.82 billion), according to government sources.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The possibilities are a direct payment to all landowning farmers, compensation for those who sold produce below government prices and a loan forgiveness program.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">PM Modi is desperate to claw back support among Indias 263 million farmers and their many millions of dependents after BJP lost power earlier this month to the Congress in three big heartland states.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Now, the government is keen to find a way to get money to farmers as quickly and simply as possible so that they can feel the benefits before the election. That could come at a major cost to its budget, which is already strained because of lower-than-expected tax revenues. It is likely to undermine its fiscal deficit target for the year ending in March.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The quickest option, and currently the most favored inside the government, is to directly pay landowning farmers 1,700-2,000 rupees per acre, said two of the sources, including one at the farm ministry.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The finance ministry also estimates a scheme, which means farmers would get the money before next sowing season, could cost up to 1 trillion rupees.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The second option would be to compensate farmers for the difference they received by selling their produce in the market compared with the government price that is set for grains and some other products, one of the finance ministry officials said. That would be cheaper, costing about 500 billion rupees, the official added.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">That option has some major drawbacks, though, as government support schemes have lost credibility because they dont cover all farm produce and claiming from the government has often proven difficult. Middlemen have also taken advantage of such schemes by persuading the farmer to give them part of any subsidy or compensation.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The most expensive option is at a cost of as much as 3 trillion rupees and the least favored inside the government, would involve writing off farm loans by up to 100,000 rupees per person. That is a policy that is being pushed hard by the opposition Congress party.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">According to a source at Farm Ministry,\" The government is considering three options - writing off some farm loans, introducing a price differential plan and direct transfer of cash to farmers.\"</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '4.jpg', '1', '1546149148', 'Latest_News', '', '', 'Admin', '1'),
(27, '2018-12-30', '11:32:41', 30, 12, 2018, 'Lamb meat exports boosted as Chinese acquire more disposable income', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Higher incomes in China are providing more families there with greater opportunities to purchase meat which was normally too expensive for them. With a newly acquired taste for lamb, China is changing the dynamics of the global sheep meat market and is now the largest producer, consumer and importer of sheep in the world.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Global lamb and sheep meat exports are dominated by Australia and New Zealand which are the second and third largest producers worldwide. While Australia has experienced rapid growth in lamb exports in recent years New Zealand has been somewhat thwarted for long term growth due to high competition from its dairying and forestry sectors.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Some hard number crunching and extended international talks has resulted in a degree of liberalisation of lamb meat trading through Free Trade Agreements (FTAs). Using these FTAs, Australia and New Zealand are in the forefront of welcome Chinese import demand giving both countries somewhat of a competitive edge over other suppliers.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">China is home to 187 million sheep and is the worlds largest flock while India with 75 million is second; Australia with 74.7 million is third; Sudan with 53.5 million is fourth and Iran with 48.7 million is in fifth place. The UK holds the largest sheep flock in the European Union as well as being the largest producer of lamb and mutton in the same region.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">While the EU is the second largest importer of lamb, shipments to there have been falling since 2010 due to economic instability on top of falling consumption and production there.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Lamb and sheep production is vital to the UK economy but since it operates in an increasingly open global market where competition, free trade agreements and market access can influence its future, it is very volatile.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Plus, with Brexit looming and the current uncertainties of what market trading will be, the UK could either be facing a lamb export crisis or become a very strong player in non-EU markets.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Another key influencer in world lamb import markets is the Middle East/North Africa (MENA) where demand is also increasing as the tradition of eating sheep meat intensifies.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Future A number of uncertainties will influence the global trading of sheep meat in the future including changes in international trade agreements, the outlook for the global economy&nbsp; and exchange rates. Swings in consumer trends to another meat, possibly beef, in the future are also a challenge facing the sheep meat export industry as well.&nbsp; Long term sheep meat forecasts suggest there will be a tight supply situation for the key exporting countries, and also indicate Australia will experience further growth but New Zealand will not.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11575/lamb-meat.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">While the EU production of sheep meat is expected to remain stagnant, global demand is forecast to grow led by China which is set to be a major influence in the sector.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Looking to 2025 A report published by the Agriculture and Horticulture Development Board (AHDB) in the UK assesses the global situation of sheep meat production and demand. It also takes a look at the forecasts for sheep meat exports in the future to 2025 and what factors will influence the sector. The report highlighted that the success of any countrys export market for sheep meat in the future relies critically on government policy. As voters start swinging to far right parties, as experienced across the EU and beyond, a new party in power could change policy. The Trump administration in the United States is a key example of how a new leader can force major change in how a country trades with the rest of the world.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Religious tendencies will also influence the global production and trading in the future but to what extent is unclear. Focusing on New Zealand, there are a number of critical factors that will influence future production of sheep meat. This will herald from any impact of environmental legislation on the livestock sector, plus further competition from the dairy sector.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Over the ditch in Australia, it will be climatic conditions that will continue to play a part in production developments there as sadly witnessed in the current drought conditions across the country but more so in New South Wales. Global production and consumption of sheep meat are forecast to grow by just over one per cent per annum, which would be a slightly higher rate than historical developments. The growth in trade, led by increased availability of Australian lamb, is expected to be nearer two per cent per annum in line with the historical increase.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The high scenario is one of sustained strong positive price and demand developments, plus a sustained move towards more free trade with global supply unable to keep pace with demand.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">There will be long-term sustained lamb export growth for Australia, with strong consumption growth in China but with global import growth constrained by export availability.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The growth in global production and consumption is forecast to be nearer two per cent per annum with trade rising by over three per cent per annum.&nbsp;&nbsp; The low scenario is the complete opposite of the high scenario with no increase in world prices and demand, increased protectionism and problems for exporting countries. In this case, there will be long term declines in production in Australia and New Zealand as they adjust to declining import markets, including China.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Main findings The AHDB report concluded that International policy will inevitably impact on trade flows.&nbsp; There could inevitably be a switch of supply for New Zealand lamb if it choose to divert produce from the EU to the increased demand and potentially higher prices from China over the next five years.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">This in turn might free up the market in the EU somewhat boosting supply and prices there.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Chinese demand for cheaper cuts makes it another advantageous market to be a part of as it adds value to the lamb carcase on export. Further growth is expected to take place in MENA, especially the Gulf States, given consumer preferences but with oil price developments also continuing to influence demand.&nbsp; The United States will also remain an important market for prime lamb and there could be scope for a further rise in imports.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">However, the main concern being how long the Chinese demand will continue to increase?&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">China could become more self-sufficient in sheep production therefore throwing the export trade to it into chaos and export countries forced to reduce stock levels.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '9.jpg', '1', '1546149761', 'Agri_World', '', '', 'Admin', '1'),
(28, '2018-12-30', '11:34:33', 30, 12, 2018, 'Chinese Apples may be available in the India Market Soon', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">An apple a day keeps the doctor away is an old English adage that means eating nutritious&nbsp;food&nbsp;like apple will&nbsp;keep you healthier and away from the doctor. Apple is known to have originated in the mineral rich mountain ranges of Kazakhstan. The outer skin has different colors depending upon the cultivator area while the juicy pulp is off-white to cream in color, offering its admirers mild sweet to tart taste. Besides their fabulous flavor and perfect portability, apples are packed with a myriad of health benefits.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Recently China-India Fruit Promotion Conference was organized by the&nbsp;India China Economic and Cultural Council&nbsp;in collaboration with China embassy. The main objective of the conference was to promote Chinese fruits &amp; vegetables in India and also explore business opportunities in the Indian&nbsp;agri&nbsp;sector. Last year in&nbsp;June, Indian gorerment&nbsp;had put a ban on chinese&nbsp;apples and pears. This ban was executed because the Indian National Plant Protection&nbsp;Organiszation&nbsp;(NPPO) detected mealy bugs and fungus on several shipments of Chinese apples and pears.&nbsp;Meanwhile, China is aggressively promoting the export of their Apples, Peers, and Pomegranate with the Agricultural Trade Promotion Center (ATPC), under the Ministry of Agriculture and Rural Affairs (MARA), with&nbsp;the&nbsp;objectives of developing National Rural Economy, increasing farmers` income and promoting&nbsp;agri-trade.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10551/img_20181127_191425.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">The delegation comprised of 10 leading Chinese companies from fruits and vegetable sector.&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">1. Liu Lihong (General Manager)&nbsp;<br>SANMENXIA HONGFENG FRUIT AND VEGETABLE CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">2. Zhao Xiaolei (Operational Manager)&nbsp;<br>JINZHOU TIANYANG TRADING CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">3. Liu Yanhui (Manager)&nbsp;<br>YANTAI YUYI FRUIT AND VEGETABLE FOOD CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">4. Wang Mengjiao (General Manager)&nbsp;<br>YANTAI YUYI FRUIT AND VEGETABLE FOOD CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">5. Xu Tao (General Manager)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br>PENGLAI YIXING FRUIT AND VEGETABLE CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">6. Pan Dehui (Chairman)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>QIXIA DEFENG FOODSTUFF CO.,LTD.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">7. Tang Hongxia (Executive Assistant)&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>YANTAI BEIFANG FRUIT AND VEGETABLE TECHNOLOGY DEVELOPMENT CO. LTD.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">8. LI Xianfeng (Manager)&nbsp;<br>RUSHAN PINGFEI FRUIT AND VEGETABLE CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">9. Cui Qingshan (Manager)&nbsp;<br>RUSHAN PINGFEI FRUIT AND VEGETABLE CO. LTD</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">10. Bu Yanni (Sales Manager)&nbsp;<br>Shaanxi baolian fruit products co. LTD.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10550/img_20181127_191123.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Furthermore, the Indian apple market is now under even greater pressure, because India and America have started a trade war. Since this week, the Indian government announced it is going to impose additional duty fees on the import of apples from America. This is the current situation. This new announcement further upsets the Indian apple market. There is not a large production of apples in India itself. Therefore, to meet its demand, India is dependent on its apple import for sufficient apple supply. How further events will occur is not sure, time will tell.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">India is reportedly allowing apple imports to enter through any port in the country, marking a significant change from its previous regulations.&nbsp;According to reports,&nbsp;imports had only been permitted through the seaports and airports in&nbsp;Kolkota, Mumbai, Chennai and Cochin, as well as at Delhis airport and the countrys land borders.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Shri&nbsp;A K&nbsp;Saxena, President, Indian Importers Chambers of Commerce &amp; Industry&nbsp;gave&nbsp;an account of Indian imports of fruits from the Chinese and other countries. Chinese delegation also gave presentation telling the USP of their products and packaging facilities available with them.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Krishi&nbsp;Jagran</span>&nbsp;team met and interacted with the Chinese delegation and assessed the need of Chinese apples and peers in the Indian Market.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">At present, China is the largest producer of apples with US at second position. Other leading producers include Iran, Italy, France, and Turkey.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '10.jpg', '1', '1546149873', 'Agri_World', '', '', 'Admin', '1'),
(29, '2018-12-30', '11:36:20', 30, 12, 2018, 'Mexicos agricultural food exports to Japan increases in 2018', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Mexicos agricultural food trade surplus with Japan in the first half of 2018 has increased by 9.2% over the same period in 2017. It went up from 569.8 million dollars to 622.2 million.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">As per the Ministry of Agriculture, Livestock, Rural Development, Fisheries and Food (Sagarpa), Mexicos agricultural food exports to Japan amounted to 628.5 million dollars at the end of the first semester.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The Ministry of Agriculture of Mexico in Japan told that this symbolizes a positive growth of exports, as their commercial value went up by more than 54 million dollars over the same period in 2017.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10163/mexican-orange.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The main products exported to Japan are:</p><ul style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">Avocado - 15.85 percent;</p></li><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">Asparagus - 5.04 percent;</p></li><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">Kabocha pumpkin - 3.88 percent,</p></li><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">Orange juice - 2.26 percent</p></li></ul><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Sagarpa said Japan is the 3<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">rd</span>&nbsp;biggest market for Mexican agricultural food exports after the US and Canada.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In addition, Tokyo is the 3<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">rd</span>&nbsp;largest exporter, 8<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">th</span>&nbsp;biggest importer and the top investor among the economies of Asia-Pacific</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '11.png', '1', '1546149980', 'Agri_World', '', '', 'Admin', '1'),
(30, '2018-12-30', '11:38:21', 30, 12, 2018, 'From Waste to Wonder: Tottoris Porous Alpha', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In less than a century, Japan has rebuilt and reconstructed itself more than any other nation on the planet. Very well known for its advancements and the zeal of bringing up innovative technology ridden ideas, Japan always looks back to keep its biodiversity and nature intact. Japan only offers 12% of its total area to agriculture and the rest is dedicated to the mountains and the biodiversity which makes the maximum of its land.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Shrinking land area is a problem which not onlyJapan faces but is a matter of concern throughout the globe. Data has suggested that the population explosion will augment the number of living beings, to about 9.5 billion by 2050. Shrinking land, deteriorating quality of soil and water scarcity are few of the global problems which shrieks for a solution. Tottori Resource Recycling Inc. from Japan addressed all of these problems with one solution. Turning the waste glass bottles into a soil treatment is what the Porous Alphais devised for.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10007/13.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Porous Alpha is a breakthrough in soil treatment solutions, which can reduce the consumption of water by 50% along with increasing the productivity, as stated by the company representative. The companys earlier experiments with tomatoes and green beans, in the semi arid area, in Morocco, Africa have shown sanguine results about the feasibility of the project.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ms. Maki Swada, International business manager, Tottori Resource Recycling Inc. tells AgricultureWorld,  Pulverized glass is burnt with additives such as shells and calcium carbonate in controlled temperature and environment to make soil conditioner from total waste.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Currently the companys only plant is situated in Japans Tottori prefecture, which faces the sea of Japan and has largest sand dunes. The faculty of Agriculture of Tottori University has long been engaged in the development of technology to cultivate crops in the sandy soil and with this development in 2004, it has been gathering the support of international agencies like IOM,UNIDO along with the governmental support from Japan.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10008/14.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Tottori around the world :</span><br><br>The various pilot projects which tested the worth of Porous Alpha in diversified regions include Morocco (2015), Mauritania (2008). Located in the Horn of Africa, Somalia also retorted positive of the pilot project started in 2016. Home to a section of Amazon rainforest and Machu Picchu, Peru was also exposed to the experimentation in the year 2018. Other pilot projects aiming for soil amendment are located in India, China and Malaysia including others.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">What is this soil rejuvenator comprises of :</span><br><br>Ms. Sawada says, Porous Alpha is mainly composed of silica and calcium oxide, similar to the chemical composition of natural sand. Since Porous Alpha has numerous pores inside, it can retain not only the irrigation water but also the liquid fertilizer, which amounts to water saving and also increases the yield at the same time.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Chemically this product, which comes in varied sizes and dimensions depending on the need of the medium by the crop, is composed of 62% of SiO2, 24.7 % of CaO, 8.6% of Na2O. Other minor elements are 2% of K2O, 1.7% of Al2O3,1% Fe2O3 and less than 1% comprises of other components like Ti, Cr, Mn, Ni, S, etc.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">How it works :</span><br><br>Porous Alpha can be used for various agricultural practices. It can be used for water saving, medium for plant growth, better aeration in the soil etc. Asa media for bio filtration, the microbes supported inside Porous Alpha decomposes the source of odor and hence can be a fit for the poultry and chicken abattoir facilities. It can also be used for water treatment via adsorption and desorption of fluorine and phosphorous ions. Tomato, Green beans, Pepper, Leaf Vegetables, Wheat, Orange and Sweet potatoes are few of the crops which has received affirmative results from the unique characteristics of this product by optimizing the water retention &amp; infiltration in the soil and reducing the usage of fertilizers by 50%.Because of the pores which are produced by burning the pulverised glass mixed with foaming agents such as shell powder or calcium carbonate, the water retention capacity of the soil increases which can retain 15% of its total volume. Based on the results of leaching test, Porous Alpha does not have any problem related to heavy metal or toxication of the soil.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '12.jpg', '1', '1546150101', 'Agri_World', '', '', 'Admin', '1');
