(31, '2018-12-30', '11:41:28', 30, 12, 2018, 'Apart from fulfilling the growing demands of lubricants, IPOL Lubricants will also strengthen agricultural economy.', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Petrochemical industry is seen as a major industry in the country and lubricants oil and gas business is an important part of it. The demand of this industry is increasing with the growing period of mechanization. According to Tech Science Research data, the market of this industry is estimated to be 9.6 billion by 2022. Lubricants are used in various types of machinery equipments, parts of vehicles etc. In this sequence,&nbsp;<span style=\"font-weight: 700;\">CEO Mr. Hari Prakash Moothedath&nbsp;</span>of one of the countrys top lubricants company,&nbsp;<span style=\"font-weight: 700;\">GP Petroleum Limited</span>, spoke to&nbsp;<span style=\"font-weight: 700;\">Krishi Jagran</span>&nbsp;and talked about the companys products and other various issues.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Q<span style=\"font-weight: 700;\">. Please tell something about GP Petroleums Ltd &amp; the group GP Global?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. GP Petroleums Limited is a listed company &amp; primarily into manufacturing of Lubes &amp; Greases in India &amp; is a part of a multi-billion global oil conglomerate GP Global Group, head quartered in UAE.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Petroleums Ltd., India, is an&nbsp;<span style=\"font-weight: 700;\"><u>ISO QMS 9001:2015, EMS 14001:2015 &amp;</u><u>OHSAS 18001</u>&nbsp;certified company,</span>&nbsp;specializes in formulating, manufacturing and marketing, industrial &amp; automotive lubricants, process oils, transformer oils, greases and other specialties under the brand name of&nbsp;<span style=\"font-weight: 700;\"><em>IPOL</em></span>&nbsp;in India and internationally for more than four decades.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The IPOL brand of GP Petroleums has established itself as one of the well accepted industrial and automotive lubricants in India with a wide network of Distributors and Dealers in the country. The company has well equipped manufacturing facilities, with automated filling &amp; packaging stations.&nbsp; GP has invested in high precision quality-control and product development labs to meet the growing needs of premium lubricants.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Petroleums plants in India has an annual production capacity of 80,000 KL. It also has an in-house Base Oil Storage facility of 15,000 KL which is one of the largest in the Indian industry, it ensures consistency of quality and supply security.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The company has planned for upgrading and refurbishing the plant and lab to meet its ambitious growth plans and to meet global standards and OEM expectations.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">IPOL has one of the widest ranges of products carefully designed to suit various applications and deliver high performances. These are available in a variety of pack sizes as per market needs. The products have several latest national and international performance specifications and approvals to their credit such as API, JASO, ACEA etc. other than OEM credentials.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Petroleums Limited looks forward to exciting activity in the Indian Automotive lube space together with IPOL Lubricants and support the&nbsp;<span style=\"font-weight: 700;\">Make in India</span>&nbsp;initiative by manufacturing IPOL Lubricants in our plants in India.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Petroleums Limited is part of GP Global group which is into refining, manufacturing of lubricants and greases, trading of oils, Bitumen &amp; Coal, having storage terminals in UAE &amp; also into shipping and logistics.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Global enables economic development by offering bespoke solutions to satisfy the commodity needs of businesses and communities worldwide. It understands that global progress and economic development requires innovative and bespoke commodity solutions. Thats why it has made its business to deliver comprehensive and integrated solutions to clients who are forging the building blocks of economies around the world.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Q&nbsp;<span style=\"font-weight: 700;\">Tell something about product range and segment which is being used?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. IPOL covers all the segments in automotive starting from two wheeler, passenger car motor oil and the commercial vehicle segment. IPOL caters to all the customers available in bazaar through range of automotive engine oils, gear oils and greases as well as with diesel exhaust fluid called Clear Blue.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">IPOL is a prominent player in a two-wheeler segment. It is also very well-accepted product in agri-markets with our range of products for tractors mainly gear oils and greases.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">IPOL is also one of the established supplier to industrial segment since 1973. It offers industrial specialty oils, metal working fluids to the industries like sugar manufacturing, auto components, metal cutting industry etc.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10362/ipol_interview-_image-3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe><span style=\"font-weight: 700; color: rgb(18, 18, 18); font-size: 17px;\">Q. What is companys vision and mission?</span><span style=\"background-color: transparent; color: rgb(18, 18, 18); font-size: 17px;\">Ans. The Company GP Petroleums, which has its flagship brand IPOL has very clear vision charted out very recently after the group, took over in 2014 end. GP Global earlier it was called as Gulf Petrochem has taken over the company and renamed it as GP Petroleums Ltd. The primary vision of this company is to be remembered as first choice of lubricant. IPOL should be the top of mind recall when a customer think to buy a lubricant.</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">This can be achieved by three innovative methods as stated in the mission statements of GPPL.</p><ol style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">GPPL will strive to become the most sought after<span style=\"font-size: 14px;\"></span>&nbsp;partner in India and chosen markets globally, for&nbsp;lubricants and value added services.</p></li><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">We will cater to the growing needs of Automotive, Industrial, Marine and Process oil markets through Technology and Compliance.</p></li><li><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">We will ensure continuous improvement, aimed at delivering higher efficiency and optimum solutions for our customers, as we move Towards New Horizons.</p></li></ol><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">GP Petroleums Limited has always been pro on development. Its products are enhancing R&amp;D capabilities. So today while shifting from Bharat IV to Bharat VI, IPOL is very well geared up to that stage to provide products of this level in 2020. GPPL always endeavour to keep up with technology to provide products as required in the market. Therefore, these are some of the areas, which need to be developed to reduce the cost of production, which are innovative and useful whether it is for a vehicle or industry.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q</span>.<span style=\"font-weight: 700;\">How do you find your products beneficial for farmers?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. Brand IPOL has made its position in Agri Sector in last couple of years because of its superior technology. Our enhanced modern R&amp;D capabilities have helped developing new product and bring it to the market. IPOL has been in the country for last 40 years and it has been identified as value for money brand.Thanks to the initiative opted last year by taking Mr Suresh Raina Cricket Player Indian Cricket Team as our brand ambassador to promote it to rural and others sectors. It is a very successful initiative as it has started giving results through our brand recognition for reliability and sustained performance.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In response to your questions, IPOL has participated in a big way in Krishi Darshan exhibition Hisar. Everywhere one can see high visibility of IPOL for example multiple numbers of IPOL branded garden umbrella at the entrance, Suresh Raina larger than life size cut-out welcoming you at the stall. The benefit what IPOL offers to the agri-industry and more specifically through the launch of new product Multi-2.0 which has a unique packing and can be used as an emergency top up for oil, both in diesel and petrol engines. Therefore, it is suggested that every farmer or consumer should have this product, which is very useful for agriculture and rural areas. Krishi Darshan Expo in Hisar is opted as our first exhibition to launch the product. To promote other products there are various schemes that IPOL regularly offers for its products.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">IPOL offers 20W-40 range of products for the customers having old tractors and 15W-40 for the customers having modern tractors. Apart from this, IPOL also offers UTTO which is a generic market name for gear oil used for tractors. IPOL is among the few players where people ask for UTTO product for its quality and long duration.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q. Which region or state contributes maximum?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. IPOL is growing tremendously in North and in South. In North, it is mainly from agro based industries and in South from automotives &amp;spare parts manufacturers. Major growth is coming from North from agri-sector and South from company sector.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q. Please tell about your export section?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. IPOL has been exporting to various countries in last few years. We have been exporting mostly rubber process oil and less of lubricants as there is a huge growth potential in India.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">We export in Nepal, Bangladesh, Sri Lanka, Middle East &amp; South East African countries.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.What is the USP of IPOL? How is it different from competition?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ans. IPOL has a complete range of products equivalent to large multinational starting from industrial and automotive covering their complete range. Therefore, it is a complete entity and is biggest supplier of rubber process, and oil next to PSU. We either import the oil or get it and reprocess it from PSU and sell it in market. So, its a one stop shop which offers end to end solution. We are targeting not only premium segment but for the mass market also. We offer appropriate technology products which is available in reasonable price.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">IPOL has a wide network across all states in India, both in urban and rural areas.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '14.jpg', '1', '1546150288', 'Interviews', '', '', 'Admin', '1'),
(32, '2018-12-30', '11:42:26', 30, 12, 2018, 'Worth a trillion dollar market: HEMP', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">What we generally know of weed/hemp is actually petite. It indeed is much more than just a green leaf or narcotic product. Hemp has numerous uses but is a victim of years of criticism. India has always worshipped the leaf and also it is a pristine element and part of its culture and traditional values, it was only in the late 1980s that this plant gathered all the ill-adjectives on the Indian land. Internationally hemp is&nbsp;categorised&nbsp;as an industrial product with Psychoactive properties of about 0%.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In an interview with Agriculture World,&nbsp;<span style=\"font-weight: 700;\"><em>IIHA, Indian Industrial Hemp Association founder, Mr. Rohit Sharma</em></span>&nbsp;explains,&nbsp;Level&nbsp;of&nbsp;THC, or tetrahydrocannabinol, the chemical responsible for most of marijuanas psychological effects in hemp is 0.3% as compared to Marijuana where it is of about 4%, which makes&nbsp;Hemp and Marijuana two different affairs.There&nbsp;are&nbsp;plethora of products that can be made from a single plant. Every part of it can be used to make things of utmost importance in our daily lives. Showing the canvas made from hemp, he explains, the&nbsp;word,&nbsp;canvas&nbsp;is derived from the word&nbsp;Cannabis&nbsp;which was the most preferred material to make the painting canvases once. The cloth that is prepared from the cannabis is so strong that the military men used it to make their super strong tents from this material.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Every part of this plant has salutary and wholesome uses. Starting with the stem to the leaves, from seeds to flower, each part is used for multiple uses. The flowers of the hemp are used for medicinal purposes concurrently the stem is an excellent source for fiber. Rohit Sharma says,&nbsp;<span style=\"font-weight: 700;\"><em>Indian</em></span><span style=\"font-weight: 700;\"><em>&nbsp;Hemp market is a trillion dollar market, if India enters in this segment exhaustively, India will dominate.</em></span>&nbsp;Commenting on the role of IIHA that it plays to connect the hemp farmers of India Mr. Sharma says,&nbsp;Farmers are the backbone of the dream that we are dreaming of, currently IIHA is helping the farmers technically with information and knowledge of how to grow it, about the soil quality it demands and the treatment it should receive for the best productivity. It is not a wild plant when you farm it, we need to give it proper care and there are requisites for the proper growth of the plant. With an investment of about 50-60 k, a farmer can easily earn&nbsp;upto&nbsp;3.5/4 lakh in 3-4 months which will upgrade the&nbsp;economical&nbsp;conditions of the farmers. Being a robust plant, it&nbsp;clamours&nbsp;for minimum water needs and no strict watch is needed after it reaches the length of 1 feet.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Talking about the available breeds of hemp,&nbsp;Mr&nbsp;Sharma&nbsp;tells,&nbsp;There are about 1000 varieties of hemp located only in India, the type and size varies from region to region. In Himalayan region of Himachal Pradesh, there are gigantic species which touches the sky with height&nbsp;upto&nbsp;15 ft. Moving down to Madhya Pradesh, the length of the plant shrinks but are abundant with seeds, similarly travelling to different topography and climate, has different types of hemps available. Akin to this, the usages vary, the longer weed plants are brilliant source of&nbsp;fibre&nbsp;and the one rich in seeds are great for making food products.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">About 30,000 products can be made from hemp.&nbsp;Fibre&nbsp;and hence clothes, biodegrade paper,&nbsp;anti termite&nbsp;wood, cosmetic&nbsp;products,&nbsp; bio&nbsp;plastic,&nbsp;construction&nbsp;material, drinks as Hemp&nbsp;flavored&nbsp;beer are included in the list among several other products. It is also used as animal feed and it used to cure diseases like cancer,&nbsp;epilepsy,&nbsp;dementia etc.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The global market is exploring this plant in numerous ways. Countries like Israel, Germany, the&nbsp;USA,&nbsp;London,&nbsp;and&nbsp;Spain are undergoing&nbsp;several&nbsp;research&nbsp;programs. China dominates the hemp market with about 70% of contribution.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Various countries in the world are already discovering the industries from hemp. Canada is one such country which has&nbsp;legalized&nbsp;cannabis in all forms since 1977.&nbsp;Though India is moving ahead, with the recent&nbsp;Uttarakhand&nbsp;govt.s notification on&nbsp;legalizing&nbsp;the cultivation of cannabis, it was a small step since only leaves and stem are&nbsp;legalized, it would still take some time before the entire plant is&nbsp;legalized&nbsp;in India.&nbsp;</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '15.jpg', '1', '1546150346', 'Interviews', '', '', 'Admin', '1'),
(33, '2018-12-30', '11:43:03', 30, 12, 2018, '10 Healthy Habits for a Healthier & Happier 2019', NULL, NULL, '15', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">As the New Year is approaching, it is time to start thinking about ways by which you can stay healthier and happier in 2019. In this article we will be talking you about simple habits or practices that you apply in your day to day life, which can have big impact on your overall health.</p><h2 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">So here are 10 healthy habits for you:</span></h2><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">1. Sufficient sleep</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It is important to understand that lack of sleep can lead to many health issues like  weak immunity, weight gain and sometimes it also affects the brain health. Hence you must take adequate sleep of around 7 to 8 hours each day for good health. Never compromise with your sleep.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">2. Regular physical exercise</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Despite knowing about the numerous health benefits of regular exercise, many of us tend follow an inactive lifestyle. You must try to include some kind of physical activity like yoga, walking, jogging, swimming or weight training. Exercise can make you fit and fine day by day.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">3. Go for Meditation</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Meditation is also a healthy habit that you must inculcate. Medication helps in relaxing and calming the body, mind and soul. Additionally, it manages stress levels by relaxing the body.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11864/medication.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"2002611573\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" __idm_frm__=\"242\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe></ins></ins></ins></div><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">4. Have Water in Morning</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Drinking a glass of water early in the morning can do wonders for your health. Water can help in digestion, it will help you discard extra weight and make you feel energetic and active for the whole day. Hence, make sure you drink a glass of water every morning before having tea or coffee.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">5. Never skip breakfast</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Breakfast is said to be the most important meal of the day thus you should never miss it. A proper and healthy breakfast will keep you full, active and also curb your hunger cravings. But make sure you eat healthy breakfast like oatmeal, dalia, eggs, sandwich or protein smoothie in the morning.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">6. Say no packaged foods</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It is important to either stop or limit the consumption of packaged or processed food items because these foods are laced with damaging preservatives and provide no nutritional value. Moreover, packaged foods can lead to weight gain and can be harmful for your overall health.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">7. Eat Fiber-rich food</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">A diet that is high in fiber can have a significant impact in your life. Fiber-rich food can promote smooth digestion, weight loss, healthy gut and also manage diabetes. Hence you must always include fresh fruits and green leafy vegetables in your diet.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11860/fruits.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" __idm_frm__=\"243\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe></ins></ins></ins></div><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">8. Limit refined sugar</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Refined sugar is basically processed sugar that can be harmful to your health. So you must avoid intake of refined sugar as it can increase weight or raise blood sugar levels. Instead you can choose some healthy alternatives such as honey, jaggery, coconut sugar or maple syrup.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">9. Little Stretching</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Before going to bed, you should do some stretching exercises that will be helpful for your overall health. These exercises will help in tightening the muscles and also strengthen them. Stretching will also prevent joint pain and tissue damage.</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">10. Maintain a Healthy weight</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">If you maintain a healthy weight it will help you in many ways. Weight management is very important as it can protect you from numerous health problems like high blood pressure, diabetes and heart diseases. So as to manage weight, you must focus on a healthy diet along with regular exercise.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">We wish you a healthy and wealthy New Year 2019!!</span></p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '1.jpg', '1', '1546150383', 'Health_and_Life_Style', '', '', 'Admin', '1'),
(34, '2018-12-30', '11:43:51', 30, 12, 2018, 'How Genetically Modified Plants can remove Cancer-Causing Pollutants from your Home?', NULL, NULL, '15', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">There is a good news for all!! Researchers have genetically modified an ordinary houseplant to remove cancer-causing pollutants from your house.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">While a range of air filters in your home can ward off allergens and dust particles, some dangerous compounds are too small to be trapped in these filters.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Small molecules such as chloroform that is present in little amounts in chlorinated water or benzene - a component of gasoline, build up in homes when you boil water or when you store cars or lawn mowers in joined garages.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">It must be noted that benzene and chloroform exposure have been connected to cancer.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11809/gm-plants.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"2002611573\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" __idm_frm__=\"258\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Scientists at the University of Washington have genetically modified a-common houseplant known as pothos ivy to eliminate chloroform and benzene from the atmosphere. The modified plants express a protein, termed 2E1 that changes these compounds into molecules that the plants can subsequently use to support their own growth, as per the study published in the Environmental Science &amp; Technology journal.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">A research professor at University of Washington, Stuart Strand said, People have not talked about these dangerous organic compounds in homes, and I think that is why we could not do anything about them. He said, But now we have engineered houseplants to take away these contaminants for us.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The group decided to use a protein known as cytochrome P450 2E1 that is present in all mammals, including human beings. In human bodies, 2E1 converts benzene into a chemical called phenol and chloroform into carbon dioxide and chloride ions.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11810/houseplants.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Nevertheless, 2E1 is placed in the livers and is turned on when you drink alcohol. Hence it is not available to help you process pollutants in the air. The professor said, We decided to have this reaction take place outside of the body in a plant. &nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Moreover 2E1 will be beneficial for the plant also. He added that plants use carbon dioxide and chloride ions to prepare food and also utilize phenol to help make components of their cell walls.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The researchers have created a synthetic version of the gene that serves as directions for making the rabbit form of 2E1. After that they introduced it into pothos ivy so that every cell in the plant expresses protein.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">As the pothos ivy does not bloom in temperate climates so the genetically modified plants will not be able to spread via pollen.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">He said plants in the home must be inside an enclosure with something to move air past their leaves, similar to a fan.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The group is presently working to raise the plants capabilities by adding a protein that can break another dangerous molecule found in the air at home  formaldehyde - present in some wood products, for example laminate flooring and cabinets etc.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '212.jpg', '1', '1546150431', 'Health_and_Life_Style', '', '', 'Admin', '1');
