(35, '2018-12-30', '11:44:18', 30, 12, 2018, 'PAAMA Agrico determined to make every farmer self sufficient in next 5 years', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p class=\"caption\" style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Krishi Jagran team in conversation with the Director of Pamma Agrico, Mr. Srinivas K.P</p><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"7822820053\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_1_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_1_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_1\" name=\"aswift_1\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">PAAMA Agrico is Indias favorite, Agricultural Equipment, Research &amp; Development organization; founded in the year 2015 with the objective of revolutionizing traditional and time intensive farming processes with sustainable technology.</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">PAAMAs research centric approach, cutting edge product features, direct communication &amp; distribution touch-points with farmers, after sales services, dynamic leadership that bring in both global and local exposure and ability to provide invincible quality &amp; pricing has&nbsp; earned it the status of being best-in-class among the Rotavators and Cultivator industry.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">A make in India brand, PAAMA has its state-of-art manufacturing facility is spread over 30,000 sq ft of Factory Space on a 100,000 sft plot of land in Doddaballapur Industrial Area, Bengaluru of Karnataka.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.1&nbsp;What&nbsp;is your Experience in Agriculture Field?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Living in a predominantly agrarian economy we are all connected to the Agriculture ecosystem in some way of the other; in my&nbsp;case&nbsp;however,&nbsp;it is a relationship of the heart. My better-half,&nbsp;has&nbsp;strong farming and&nbsp;agricultural roots, with&nbsp;land holdings&nbsp;in regions of&nbsp;Srirangapatnam, Karnataka;&nbsp;where the lush green sugarcane and paddy field sway to the zephyr, as if dancing to the&nbsp;soothing melodic flute when the&nbsp;wind&nbsp; gushes pass them conveying the devotional story between them and their farmer.&nbsp;On the personal front, my proximity&nbsp;with farmers as family members has enhanced my understanding of the intimate relationship between a farmer has his field which is like a mother and a child, with&nbsp;the farmer working&nbsp;tirelessly to provide his best supplies to ensure that the field sees its bounties.&nbsp;&nbsp;&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">On the professional front, I have had the opportunity to&nbsp;steer Indias&nbsp;largest Harvester manufacturer&nbsp;that is also rated&nbsp;amongst the leading five&nbsp;Agri-Equipment manufacturers,&nbsp;CLASS, for&nbsp;over 4 years. This hands-on industry and marketing exposure&nbsp;enhanced my&nbsp;knowledge&nbsp;from the&nbsp;&nbsp;manufacturing&nbsp;perspective;&nbsp;setting&nbsp;&nbsp;course to my entrepreneurial journey of launching PAAMA&nbsp;Agrico, Indias&nbsp;most&nbsp;&nbsp;innovative&nbsp;&nbsp;and farmer friendly&nbsp;Agri-Equipment&nbsp;manufacturing and sales&nbsp;organization.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.2 What was the reason behind starting PAAMA&nbsp;Agrico?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">When the thought that Agriculture touches&nbsp;everybodys lives&nbsp;occurred&nbsp;to me,&nbsp;I chose to&nbsp;move on as MD of LAPP India Pvt. Ltd., German cable and connectivity solutions major to lead CLASS India,&nbsp;a leading&nbsp;Agri-Equipment manufacturer.&nbsp;Consequently&nbsp;when&nbsp;the&nbsp;idea that&nbsp;working for agricultural sector&nbsp;is working for society,&nbsp;struck the chord&nbsp;within, I&nbsp;quit CLASS India and started&nbsp;PAAMA&nbsp;Agrico, an&nbsp;organization whose&nbsp;heart and soul would focus on the farmer as its centre point&nbsp;creating good quality products at a good price.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Further my&nbsp;experience&nbsp;with CLASS&nbsp;had&nbsp;further&nbsp;cemented my&nbsp;notion that the India farmers are not&nbsp;receiving&nbsp;their dues. Though we are an agrarian economy, the equipment and the support provided to Indian farmers is no comparison&nbsp;to their&nbsp;developed counterparts.&nbsp;Indian farmers are contended people, with high&nbsp;level of satisfaction&nbsp;and they&nbsp;generally do not question or demand for the new, this further inspired me to do my bit for&nbsp;the unsung heroes of our nation. By&nbsp;providing&nbsp;Agri-Equipment&nbsp;that would facilitate them in achieving their goal of witnessing a prosperous crop&nbsp;whilst treating&nbsp;farmer as the king.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9605/indian-farmer.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.3 Which kind of products&nbsp;</span>are<span style=\"font-weight: 700;\">&nbsp;you providing to&nbsp;farmers?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">We are young organization that was launched in the year 2016 and&nbsp;are in the&nbsp;nascent&nbsp;phase of our growth with&nbsp;primary&nbsp;focus on&nbsp;Tractor Driven&nbsp;Agri-&nbsp;Equipment &nbsp;for&nbsp;the first phase of our launch. Those that are&nbsp;currently&nbsp;available in the market are below:&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">(a)&nbsp;</span>Rotavator s:&nbsp;A&nbsp;Rotavator&nbsp;is a farm implement used forsecondary tillage. &nbsp;They&nbsp;stir and pulverize the&nbsp;soil,&nbsp;eitherbefore planting (to aerate the soil andprepare a smooth, loose seedbed) or afterthe crop has begun growing. &nbsp;PAAMA&nbsp;Agrico&nbsp;Rotavators&nbsp;have&nbsp; a&nbsp;working width 900mm till 1800mm . Implements have fixed&nbsp;ratio single speed&nbsp;drive as well as two speed gear drive.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">(b)&nbsp;</span>Blades:&nbsp; PAAMA&nbsp;Agrico&nbsp;specializes in manufacturing&nbsp;rotavator&nbsp;blades that can be used to replace old and worn out blades of its own&nbsp;rotavators&nbsp;or to&nbsp;improve&nbsp;the&nbsp;yield&nbsp;of&nbsp;rotavators&nbsp;manufactured by other organizations. There are two types of&nbsp;blades that are being manufactured by PAAMA&nbsp;Agrico:&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Silver Boron&nbsp;Steel&nbsp;Blades:&nbsp;Medium carbon steels with added Boron and Chromiumfor corrosion and heat resistance. This has&nbsp;hardenabilityequal to high carbon steels. Mostly used for applications,where there is constant wear performance. Silver blades have a life approximately 20% more than theconventional blades&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">DiamondBlades- Silicon Manganese Steel or Spring Steel Siliconis present in this alloy which provides High elasticity andmanganese gives strength and hardness. &nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Diamond Blades have a life of 20% more than the silverblades.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In the next stage of our growth we aim to launch the following&nbsp;products&nbsp;under the&nbsp;Self Propelled Machines category&nbsp;- Forage&nbsp;Harvesters,&nbsp;Tractors,&nbsp;Corn Pickers&nbsp;and&nbsp;Grain Harvesters&nbsp;among the others.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.4&nbsp;What&nbsp;challenges did you face in the beginning stage of PAAMA&nbsp;Agricos&nbsp;launch?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The core differentiation in PAAMA&nbsp;Agricos&nbsp;founding&nbsp;philosophy&nbsp;is its&nbsp;research&nbsp;centric&nbsp;approach.&nbsp;We&nbsp;never believed in&nbsp;making the&nbsp;product,&nbsp;selling&nbsp;it and then&nbsp;identifying&nbsp;the&nbsp;problems after sale.&nbsp;On the contrary we&nbsp;developed&nbsp;the product, tested it&nbsp;through all hypothetical&nbsp;scenarios and&nbsp;then&nbsp;rolled it into&nbsp;the market. So we really didnt face launch&nbsp;challenges&nbsp;when it came to product launch. However as a part of CRM&nbsp;Strategy&nbsp;we travelled across markets to get real&nbsp;ground level&nbsp;feedback. As a Founder,&nbsp;I&nbsp;believed that&nbsp;it is&nbsp;most important&nbsp;for me to&nbsp;get a&nbsp;sense into the sentiment of the market so I took up the task of travelling thousands of&nbsp;kilometres&nbsp;for two&nbsp;full&nbsp;months evaluating&nbsp;the performance of the blades&nbsp;and&nbsp;rotavators&nbsp;from&nbsp;various farmers, each of whom&nbsp;functioned in a unique environment.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Also the founding team consisted of very few people from pure agricultural&nbsp;industry;&nbsp;they came from staunch corporate backgrounds&nbsp;with rigid customer support policies. When&nbsp;a single&nbsp;customer had called complaining about the steel compatibility, a decision was taken to&nbsp;recall the entire batch of 18, 000 blades supplied to different customers spanning across various&nbsp;geographies.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">I remember few such&nbsp;incidents as some&nbsp;of the most challenge yet lucrative part of the journey.&nbsp; As the adage goes&nbsp;fruits of&nbsp;hard-work&nbsp;are the sweetest, both&nbsp;these events reaped a&nbsp;phenomenal&nbsp;return winning us immense popularity&nbsp;and loyalty from our&nbsp;customers.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9607/paama-agrico_-blades.png\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe><span style=\"font-weight: 700; color: rgb(18, 18, 18); font-size: 17px;\">Q.5&nbsp;What&nbsp;areyour plans for companys growth?&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">PAAMA&nbsp;Agrico, is inspired by the ambitious mission of making every farmer of India self sufficient within the next 5 years. We aim to do so by supplying them with efficient, durable and&nbsp;reliable&nbsp;Agri-Equipment&nbsp;that are Made in India and Best for India. This will enable super efficient farming process- that will save labour, time and material resources and most importantly have no downtime, one of the most important terminologies in the book of automation.&nbsp;&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Having a strong foothold in Karnataka,&nbsp;Andra&nbsp;Pradesh and Tamil Nadu and keeping in pace with its mission&nbsp; PAAMA&nbsp;Agrico&nbsp;will expand its presence to the rest of the&nbsp;nation; now that is a huge&nbsp; task on hand.\" According to India Brand Equity foundation, \"Agriculture being the&nbsp;primary source of livelihood for about 58 per cent of Indias population and the Total area in India, sown with&nbsp;rabi&nbsp;crops reached 64.29 million hectares in February 2018.\" to meet such numbers PAAMA&nbsp;Agrico&nbsp;has to quintuple its capacity and we are working meticulously to pump our production and capabilities to cater to the market.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Given our market response, with our&nbsp;competence&nbsp;to provide European Quality with Chinese pricing, we are quite positive to lead the nations&nbsp;Agri-Equipment market by 2023!&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.6&nbsp;how&nbsp;is your company committed toprovide&nbsp;best services to&nbsp;farmers?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In tune with PAAMA&nbsp;Agricos&nbsp;founding objective of enabling every Indian farmer with&nbsp; best-in-class&nbsp;Agri-Equipment&nbsp;that will in-turn&nbsp; help cater to the huge 159.6 million hectares arable land resource of India (World Bank estimate in 2015), a&nbsp; high-end manufacturing apparatus structured on the philosophy of automation and empowered with most sophisticated technology was set-up in the year 2016.&nbsp; Quite aptly it is also referred to as the Agri-Equipment Design House of India. The revolutionary make in India brand with a state-of-art manufacturing facility is spread over 30,000 sq feet of Factory Space on 100,000&nbsp;sqft&nbsp;plot of land in&nbsp;Doddaballapur&nbsp;Industrial Area,&nbsp;Bengaluru&nbsp;of Karnataka.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">We are not a company that thinks&nbsp;we know what our customers want, we believe in listening to our customers. A good product is not that one which is credited with&nbsp;certifications&nbsp;from industry bodies but one which also wins the trust of the farmers by&nbsp;supporting&nbsp;him in his farming process. Good quality products that every customer should use, simple to use yet&nbsp;to be advanced technologically.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Approximately 12, 000 blades are manufactured on a daily basis in a single line in comparison to 4000-5000 which is the industry standard. An individual&nbsp;Rotavator&nbsp;takes no more than 15&nbsp;mins&nbsp;to come off the line in PAAMA&nbsp;Agricos&nbsp;premise. It is the only&nbsp;Agri-Equipment manufacturer to deploy Robots in the facility for welding and handling purposes. Adamantly, batch processes are not followed at the organization; be it designing of the blade or the machine, the philosophy of doing one at a time is strictly followed.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.7 Give a brief comment on current situation of Indian farmers.&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In the current scenario, I dont think we can use a blanket term, Indian&nbsp;Farmer,&nbsp;that&nbsp;generalizes all farmers on similar&nbsp;parameters, given that farmers&nbsp;from different&nbsp;geographies of India offer a kaleidoscopic view of the nations agricultural landscape.&nbsp;For instance, while&nbsp;farmers&nbsp;in Kerala&nbsp;are&nbsp;fighting floods,&nbsp;those&nbsp;from the north-east are tackling droughts.&nbsp;A few&nbsp;are&nbsp;working towards&nbsp;bringing&nbsp;in bio-engineered products&nbsp;whereas few&nbsp;others are channelling their efforts to keep it organic.&nbsp;&nbsp;&nbsp;In few regions such as belts of Mangalore&nbsp;average land ownership is 2,000&nbsp;sqft&nbsp;whereas Punjab&nbsp;and&nbsp;Maharashtra have&nbsp;an entitlement of 100s of&nbsp;acres of land.&nbsp;&nbsp;&nbsp;Besides&nbsp;where&nbsp;there are huge organized corporate land holdings making pathway&nbsp;for consolidation, there&nbsp;are several agricultural plots&nbsp;that is even as small as 1&nbsp;quintal&nbsp;space. With&nbsp;such&nbsp;a diverse&nbsp;mechanism&nbsp;the dependencies such as&nbsp;financial sources,&nbsp;Agri-Equipment, supplies&nbsp;are varied&nbsp;in each situation.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Hence generic&nbsp;view or&nbsp;generalizing&nbsp;any problem, solution&nbsp;or&nbsp;product&nbsp;pertaining to the farming industry&nbsp;is not possible.&nbsp;Rather a&nbsp;microscopic understanding&nbsp;of&nbsp;the&nbsp;scenario&nbsp;and a&nbsp;customized solution&nbsp;for each specific&nbsp;situation&nbsp;is&nbsp;really&nbsp;the need&nbsp;for&nbsp;the hour.&nbsp;&nbsp;&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9608/paama.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"7822820053\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_4_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_4_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_4\" name=\"aswift_4\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe><span style=\"font-weight: 700; color: rgb(18, 18, 18); font-size: 17px;\">Q.8How&nbsp;are yourproducts&nbsp;inaccordance withthefarmers requirement?&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The founding mission of PAAMA&nbsp;Agrico&nbsp;has been to be a farmer centric organization.&nbsp;Right from&nbsp;its&nbsp;inception&nbsp;the&nbsp;business&nbsp;strategy&nbsp;has been to keep&nbsp;its&nbsp;ears&nbsp;planted to the ground&nbsp;and we do this&nbsp;quite literally, as we monitor&nbsp;the&nbsp;soil&nbsp;conditions&nbsp;and understand the diverse requirements from various geographies.&nbsp;Further&nbsp;we&nbsp;have our eyes&nbsp;set on the seasonal patterns&nbsp;to custom make and ready our&nbsp;Agri-Equipment based on&nbsp;anticipatory&nbsp;requirements.&nbsp;&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">As an&nbsp;example would&nbsp;refer to&nbsp;PAAMA&nbsp;Agrico&nbsp;rotavators&nbsp;that have a&nbsp;modular&nbsp;design where&nbsp;most&nbsp;parts&nbsp;like&nbsp;&nbsp;&nbsp;the&nbsp;sealing,&nbsp;dimensions, location of the&nbsp;transmission&nbsp;can be shifted around to suit individual requirement.&nbsp;The farmer can play around with the parts to remodel&nbsp;rotavators&nbsp;to&nbsp;suit its soil conditions&nbsp;and his comfort level.&nbsp;&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.9 what is your view on government schemes for farmers welfare?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Initiatives&nbsp;such as loan waivers, crop insurance subsidies,&nbsp;and easy&nbsp;availability of credit are all welcome moves by the government.&nbsp; &nbsp;In addition to this,&nbsp;it will be very encouraging to&nbsp;gain Governments support and&nbsp;involvement in&nbsp;mechanization of&nbsp;Agri- Industry by equipping&nbsp;farmers&nbsp;with&nbsp;essential and advanced farming&nbsp;knowledge&nbsp;and practices&nbsp;amidst limited&nbsp;natural resources.&nbsp; As the future of agriculture is directly correlated with engagement of right Agriculture- Equipment that have no down-time; are&nbsp;cost-effective and are also in conformity with natural climatic condition of the nation. Government&nbsp;can&nbsp;play an&nbsp;indecisive role in providing these equipments at&nbsp;subsidised&nbsp;cost to farmers. Thus,&nbsp;equipping&nbsp;Indian Farmers&nbsp;with necessary&nbsp;Agri&nbsp;-Equipment&nbsp;and&nbsp;financial&nbsp;assistance required&nbsp;to actively&nbsp;engaging&nbsp;in mechanization of agricultural industry.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.10 Do&nbsp;you&nbsp;feel&nbsp;</span>use<span style=\"font-weight: 700;\">&nbsp;of technology in Indian agriculture industry will be another revolution?&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Since Indias Independence,&nbsp;to date, technology has been&nbsp;the de facto&nbsp;element instrumental&nbsp;in bringing&nbsp;about several revolutions and advancements. Be it in the line of communication, transportation, banking,&nbsp;businesses,&nbsp;marketing and sales,&nbsp;education, healthcare...it has really touched and transformed every aspect of our life. This implies to agricultural industry as well.&nbsp;&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">From traditional, bullock driven soil ploughs to&nbsp;cutting edge&nbsp;rotavators; manual harvests&nbsp;to mechanical harvesters, tedious watering&nbsp;logging to sprinklers are&nbsp;all existing and successfully&nbsp;accepted technological&nbsp;and mechanical advancements of the Agricultural industry.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">However our western counterparts and few organized players of the&nbsp;industry are much ahead of us and are effectively using  Precision Agriculture that is in its true sense a technological revolution of the agricultural industry. Gadgets like&nbsp;drones&nbsp;are used&nbsp;to&nbsp;closely monitor the crop which&nbsp;measures the&nbsp;stress on plants, irrigation&nbsp;level&nbsp; and&nbsp;plant population counts&nbsp;etc. Such deep down&nbsp;analysis enables&nbsp;quicker problem&nbsp;identification&nbsp;and&nbsp;solutions&nbsp;and ultimately drives improvement.&nbsp;Considering such advancements I would just say that we are on the brink of technological revolution of the&nbsp;Agri-Equipment industry that is&nbsp;due&nbsp;to witness&nbsp;Uberization&nbsp;of equipment.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q.11&nbsp;Would&nbsp;you like to convey any message to the farming community?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In the book of occupations, I will place farming on the forefront of the Noble&nbsp;Careers&nbsp;list. It is very difficult to commemorate&nbsp;the farmer&nbsp;for his contributions&nbsp;towards the society.&nbsp;&nbsp;His tireless&nbsp;efforts to&nbsp;feed the&nbsp;mouths of billions of&nbsp;dependant population&nbsp;amidst several uncertainties&nbsp;and crisis&nbsp;situations should&nbsp;be an inspirational story for the&nbsp;future generations.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">A&nbsp;Food for thought&nbsp;for parents,&nbsp;academic&nbsp;institutions&nbsp;and all educational and developmental&nbsp;organizations; is to&nbsp;necessarily provide farming exposure to future generations. Thus,&nbsp;enabling the cultivation&nbsp;of&nbsp;a&nbsp;healthy,&nbsp;genetically dynamic, organically&nbsp;nurtured young crop that&nbsp;does not&nbsp;wither away from the challenges&nbsp;of work&nbsp;environment&nbsp;and makes&nbsp;the best of available resources&nbsp;to build a strong India; an&nbsp;unshakeable&nbsp;nation that&nbsp;bares&nbsp;the mettle of the farmer.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><em><span style=\"font-weight: 700;\">I will conclude by tweaking the universal prayer,&nbsp;Thank you God for giving me the daily bread and also the farmer&nbsp;who worked so hard to bring it for me!&nbsp;</span></em></p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '16.jpg', '1', '1546150458', 'Interviews', '', '', 'Admin', '1'),
(36, '2018-12-30', '11:45:05', 30, 12, 2018, 'Pesticides are causing Cancer: Is it Myth or Reality!', NULL, NULL, '7', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Pesticides are used by farmers for killing the pests. But now there are rumors that these deadly pesticides are causing cancer to the farmers.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Recent study by the&nbsp;Brazilian Toxicology Pathology had published the results of their research in the&nbsp;European Journal of Toxicological Sciences.&nbsp;De&nbsp;Camargo, a toxicological pathologist along with Professor of Pathology Joao&nbsp;Lauro&nbsp;Viana&nbsp;highlighted that pesticides available in the market does not support the existence of any association between cancer signs in humans and occupational exposure or diet.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">De&nbsp;Camargo&nbsp;explains&nbsp;further&nbsp;that some chemicals may actually be carcinogenic to the human species. Accordingly, their synthesis, handling and use must be subject to strict safety standards and procedures.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">\"There are repeated reports of possible associations, but they are inconsistent owing to scientific deficiencies, including flaws in the design of studies, a deficiency in the composition of exposed groups and their controls, poor determination of exposure (doses), and poorly characterized cancer diagnoses, he points out in a report produced as part of the Agro Science and Technology initiative.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">On the whole, de&nbsp;Camargo noted that these deficiencies \"weaken the weight of evidence on the causal association between cancer and pesticides. Important and frequently overlooked aspects to define a cause-and-effect relationship are the identification of the mode / mechanism of action by which a pesticide would cause cancer in man and, when evidence is obtained from laboratory animals if the results obtained from those animals are extrapolated to the human species \".&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11652/glyp.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In the view of de&nbsp;Camargo, risk and / or risk assessments by regulatory agencies around the world \"are making the detection and management of molecules that could cause cancer in humans more effective.\" According to a toxicological pathologist, risk management is the most realistic and operational tool.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">\"The effort made over the last 30 - 40 years to harmonize global hazard and pesticide risk assessment procedures and disseminate the results of these practices, has raised awareness among health authorities, the productive sector, researchers and public opinion, about the possibility of chemical risks being managed,\" he says.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">De Camargo&nbsp;is a member of the Joint Meeting of Pesticides (JMPR) of the Food and Agriculture Organization of the United Nations. He is also a member of the editorial boards of renowned scientific journals, such as the International Scholarly Research Network, Toxicology and the European Journal of Toxicological Sciences.&nbsp;</p><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" __idm_frm__=\"278\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe></ins></ins></ins></div><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"></ins></div>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '3.jpg', '1', '1546150505', 'Health_and_Life_Style', '', '', 'Admin', '1'),
(37, '2018-12-30', '11:45:17', 30, 12, 2018, 'Prosperity, Happiness and Self Sustenance - A Kitex Model Development', NULL, NULL, '', NULL, NULL, NULL, NULL, '  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n<div><br></div><div><p class=\"caption\" style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">KrishiJagran Kerala correspondent in conversation with Shri. Sabu M. Jacob Chairman of the Kitex Group of Companies.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Alienating established political parties and self-proclaimed leaders of development, a model of self-sustained growth is being developed at Kizhakkambalam, a village in Kochi, Kerala. &nbsp;This village is a typical example of a model village, with greenery and organic farming on one hand and amenities and infrastructure on another hand. The guiding force of this village aims to bring equal prosperity to each and every villager. The great visionary who sow the seeds for this was none other than famous industrialist Shri. M C. Jacob, founder of Kitex Group. Now the leadership is under Shri. Sabu M. Jacob, Son of M.C Jacob, and also the present Chairman of the Kitex Group.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? M.C Jacob was a respectable industrialist in Kerala, how you evaluate the shift of leadership from him to the next generation?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Our father wished the growth of the village along with the growth of Industry and we also believe in the same and we are endeavoring for it.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? How Kitex entered to food safety and organic farming sector and what are the influencing factors?</span><br><em><br></em>We are not only focusing on industries and also on all sectors of development. &nbsp;While referring to village development it is not only about giving an impetus to agriculture but also inclusive of infrastructure development, housing, and food security. Agriculture is just a part of village development.&nbsp; At the same time, agriculture is the basis of humanity.&nbsp; The imbalance that happened as a result of the shift from agriculture to industries became the root cause for all the issues. When human beings led a life in harmony with nature there was fewer health issues and disease. &nbsp;We intend to bring the best of old days along with the fruits of development.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9530/image-2.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_1_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_1_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_1\" name=\"aswift_1\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">We focus on cleaning ponds, small water bodies, proper waste disposal and bringing barren land under cultivation. &nbsp;We have observed that it has brought positive changes to the ecosystem. Frogs, crickets and small fishes like carps can be found here in abundance which was about to vanish. We may think, the frog is insignificant but they play a significant role in controlling mosquitoes, same with small fishes they prey on mosquito eggs and also they purify water. The worst damage to nature is done in the form of constructing innumerable buildings, at the same time which cannot be undone, we intend to move forward with the available resources.</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? Is there any influence of Kerala Governments Janakeeyasootranam and Kanjikuzhi Panchayat Model?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The success rate of a scheme is measured in terms of a number of participants and practitioners. Here we experimented kitchen garden among 500 people. For that they need an interest in farming also. Later we concentrated farming in an area and started in a commercial manner, the advantage of practicing agriculture in a commercial manner as compared to kitchen garden is that we can help and take care of farming in a better way. Any issues like a pest, can be tackled easily as compared to kitchen garden spread in different households.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9531/pond-3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Chicken available in market are grown by injecting hormone and are not good for health. Here we have chicken grown in a natural manner and the byproducts are used for making organic waste. In order to ensure quality supply of fish, fish farming is practiced in a systematic way. For fish farming a pond is set by growing algae and small fishes which feed on Algae are introduced. Later</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span><em style=\"color: rgb(18, 18, 18); font-size: 17px;\">Varaal</em><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">fish (Snakehead aka River Sole) will be introduced which consumes small fishes. So the fishes from this pond have high nutritional value.</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? Why only in Kizhakkambalam</span>?</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Not like that. This is our village and here is where our industries are located. So we just want to make this a model panchayat and then analyzing its pros and cons we will extend to other parts.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? Describe rain water harvesting, waste disposal, and bio gas?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In last two years we have no scarcity of water. Even when Ernakulum District was facing scarcity of water, here water was available in abundance. Regular cleaning of canals and constructing check dams enabled to retain water. Special initiatives are taken to protect ponds. Every house should have a rain water harvesting method. We are planning to implant biogas plant in each and every household. But there is a limitation as this can solve only organic waste.<br><br>For addressing the issue of plastic waste, the existing structure is not enough and we have launched Clean Kizhakkambalam Project. Under every ward should be cleaned by the members of that ward, they have to clean the road and canal that come under their ward limit. This has to be done every Sunday and around 200 to 300 members have to do it voluntarily. They have to clean the pavement and clear the foliage.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/9528/goat.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"7822820053\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? Other Agricultural Activities?<br><br></span>We envision to make Kizhakkambalam a health village also. By 2019, Herbs will be farmed on commercial basis.&nbsp; One medicinal plant will be provided for one home. They can choose and cultivate the same in their backyard. This can add additional revenue to the villagers. Sugarcane cultivation is also in stack, which will be used for making jaggery. We are determined to make use of every inch of the barren land. Sugarcane farming is not very popular in Kerala but it is really promising. There are schemes for goat, hen and flower farming, total responsibility from farming to market will be undertaken by the group.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? All the products in food security market are produced?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">People hesitate to do farming here due to the manual labor needed and also due to the expense they have to bear on this regard. When we distributed free plantain saplings, none took effort to plant it eventually it got rotten. At the same time, when we distributed plantain and took initiative to plant it by sending a team, it became successful. We have planted around 200000plantains and that created excess product in the market. So we sold it for Rs. 30 and gave the farmers same amount. Both the consumers and producers became happy, because normally a kg was sold for Rs. 60 and farmers were paid Rs. 20. By regulating the market price, both producers and consumers became happy. We buy products from the producers and sold to consumers at same cost, which brings no loss to producers but only profit.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? How you look upon Gandhi Jis GramaSwaraj and Compare it with Kizhakkambalam.?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">This is the complete manifestation of GandhiJis dream. Gandhi Jis dream of self-sufficient and sustainable development can be seen here in its complete form.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? How far you were able to make every household of Kizhakkambalam &nbsp;a self-sufficient unit ?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\"><br></span>We have faced several obstacles especially from political parties. There were even occasions of that we were not able to make a forward step. Even Panchayat opposed us directly. In that situation we started to tackle it. We contested election and won seats. On that occasion we faced opposition from ruling party, opposition party and from all spheres. They were worried to lose their significance. But now we have surpassed that. &nbsp;We have clear account of everything. We have constructed houses, road and implement schemes in a time bound manner and we will achieve our target within 2 and half years.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Q? What all plans in stake?</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">We intent to bring in developments and changes according to present trend. Focus will not only be on agriculture but also on allied activities. &nbsp;But we will ensure a balanced growth.&nbsp;<br><br><span style=\"font-weight: 700;\">Interviewed by Dhanya M.T, Krishi Jagran Kerala</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Translated by Sreeja ,&nbsp;Krishi Jagran Kerala</span></p></div>', '1', '17.jpeg', '1', '1546150517', 'Interviews', '', '', 'Admin', '1');
