(38, '2018-12-30', '11:45:58', 30, 12, 2018, 'Important Things to Remember For a Perfect Christmas', NULL, NULL, '5', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Christmas time is an exciting season for everyone. We&nbsp;love everything about it. The&nbsp;weather is awesome,&nbsp;music is magical, the lights are&nbsp;entrancing, decoration is mesmerizing and the best part is of&nbsp;exchanging gifts.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">We get dressed up, visit church to offer prayers and everything looks just so beautiful&nbsp;in all of the glittering aspects of Christmas. In so much of activities,&nbsp;there are a few things we all need to make sure&nbsp;that&nbsp;we dont forget.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Exciting Things to Do This Christmas:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Spend Time With Loved Ones:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Christmas and school winter vacations go hand in hand. What more do you want for celebrations?&nbsp; Just spend as much time as you want with your near and dear ones. Enjoy the moments with your family and friends that youll remember for years to come.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Breathe:&nbsp;&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Dont keep yourself so busy that you dont get time to relax. Keep out some time for yourself.&nbsp;Do the things you really enjoy.&nbsp;Take a deep breath and get in some rest and relaxation. Enjoy the quiet moments&nbsp;with Jesus.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11640/ch3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Gifts:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Does not necessarily means an expensive gift but it can include a handmade card, cake or cookies that youve made. It will show love and care for your loved ones.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Connect With Old Friends:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Christmas is the best for re-connecting with your old friends. You can visit them or even a phone call can make a big difference. Make sure you tell them that you were thinking about them and wishing them well.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Giving:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Christmas is the perfect season for giving. Give to other people that arent just your friends and family. But who are needy. Just spread Christmas cheer with giving to those in need.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Plan Simple:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Planning simple Christmas decorations can do wonders. Tell your kids also to say thank you while receiving gifts. It is not necessary to give expensive return gifts. Get enough sleep, drink enough water,&nbsp;and eat&nbsp;good food.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Let It Go:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Remember its just a bad moment, or rough day, it doesnt mean the whole of Christmas is&nbsp;ruined.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">You Are Lucky:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Think about how lucky you are. Among all the busy and crazy, be thankful for the big things. Think about a family that loves you, food on the table,&nbsp;a&nbsp;roof over your head.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Be Thankful:&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Remember to be thankful for the little things including a quiet moment alone, a good meal, a smile, being around your loved ones etc.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '214.jpg', '1', '1546150558', 'Health_and_Life_Style', '', '', 'Admin', '1'),
(39, '2018-12-30', '11:47:29', 30, 12, 2018, 'Inland Aquaculture in Kerala; Challenges and Opportunities', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Aquaculture being a fast growing food production system will continue to strengthen its role in contributing to food security and poverty alleviation in India and many developing countries. There are several emerging diseases for farmed fish in India, particularly for freshwater fish and prawns. The practice of seed import without adequate precautions could bring many new diseases to the aquaculture sector in Kerala. The indiscriminate capture of ornamental fish from the wild without adequate replenishment is a serious threat to the biodiversity of the state</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Fish and fisheries products are the primary protein sources for some 950 million people worldwide, and are an important part of the diet of many more. Fish is the most heavily traded food commodity in the world. Aquaculture being a fast-growing food production system, will continue to strengthen its role in contributing to food security and poverty alleviation in India and many developing countries, in view of the stagnating yields from capture fisheries and increasing demand for fish and fishery products. Despite its high productivity, there is very little recognition of freshwater- dependent fishery production due mainly to a general lack of data and scientific literature compared with industrial marine fisheries. The majority of freshwater fisheries and aquaculture is small-scale and has received only scant attention during the past few decades.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The world production of fish reached an all-time high of about 172 million MT in 2018, largely contributed by the increasing aquaculture.&nbsp; The world inland and coastal aquaculture has been steadily increasing over the past few years. India with an area of 3.3 million sq. km and a population of over a billion people, occupies second position in the world in aquaculture production, contributing to over 10 million MT of fish. Inland aquaculture has been the major fish producing system in India. Most of the aquaculture activities in India could be regarded as rural aquaculture. Freshwater aquaculture in village tanks and ponds follow the improved traditional or semi-intensive composite culture/ polyculture system and they serve the household needs for fish and generate some additional income for the family.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Freshwater resources of Kerala</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The state of Kerala is gifted with rich resources of freshwater bodies suitable for aquaculture. The state has a total freshwater area of 1, 58,358 ha, consisting of reservoirs (42,890 ha), private ponds (21,986 ha), irrigation tanks (2,835 ha), freshwater lakes (1,620 ha), panchayat ponds (1,487 ha), village ponds and other water holds (1,317 ha), and check dams, bunds, barriers or anicuts (1,138 ha). The state has 41 west-flowing and 3 east-flowing rivers, constituting an area of 85,000 ha.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11680/1.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Middle_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"4556347401\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 620px; height: 250px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 250px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"250\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 250px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">There are 54 reservoirs in the state (2 major above 5,000 ha, 13 medium of 1,000 to 5,000 ha and 39 small of less than 1,000 ha). The total reservoir area is the highest in Idukki district(18,651 ha) followed by Palakkad (7,132 ha), Thrissur (3,706 ha), Kozhikod (3,172 ha) Kollam (2,590 ha), Pathanamthitta (2,505 ha) and Thiruvananthapuram (2,340 ha). The maximum number of small reservoirs is in the Idukki district (14) followed by Palakkad (10) Thrissur (6) and Pathanamthitta (3). The freshwater lake area is maximum in Idukki district (624 ha) followed by Kollam (440 ha), Thrissur (295 ha) and Thiruvananthapuram (250 ha).</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Freshwater aquaculture development in Kerala</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Modern fish culture in India became prominent with the success and perfection of induced spawning techniques for the Indian major and exotic carps. Catla catla and Labeo fimbriatus were successfully bred at Malampuzha, and this centre became the focus of inland fisheries development in Kerala. Trials conducted at different parts of the country laid the scientific foundation of composite fish culture techniques. Commercial hatchery production of giant freshwater prawn, Macrobrachium rosenbergii was also achieved with the experiments conducted at the Fisheries College, Kochi in 1987 resulting in a cost-effective technology.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Lack of diversification in aquaculture</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">At present, freshwater aquaculture system in Kerala remains restricted to carp culture in a few private ponds, prawn cum paddy culture in limited areas in Kuttanad and Kole lands, stocking of carps in a few irrigation reservoirs, and river ranching in a few rivers on a limited scale. No serious effort has been taken to develop coldwater fish culture, game fisheries, culture of indigenous fish species of Kerala, freshwater pearls, etc. The farming of Karimeen(Etroplus suratenis ) has recently emerged as a popular practice in ponds, and often in cages set in open water bodies. Advanced farming practices such as cage culture; pen culture and running water culture are emerging in many places, and have great potential for utilizing vast areas of freshwater bodies in the State.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Adverse climate</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The Kuttanad area (55,000 ha) and the Kole lands (13,632 ha) suitable for paddy cum fish culture in Kerala lie below the mean sea level, which make them prone to frequent floods. In many places, the flood water level is raised up to 4 feet above the existing embankments during heavy monsoon showers leading to crop loss. The recent floods have caused enormous damage to the freshwater ecosystems in the State, and this damage has not yet been assessed.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Seed import and threat of diseases</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">A major share of the seed required for freshwater aquaculture is imported from AP, Tamil Nadu and West Bengal by long distance transport. The regulation of seed import is also weak and there is no effective control on the species brought and none of the quarantine conditions are followed in such live transport and stocking&nbsp; in the water bodies of Kerala.This practice poses serious biodversity and zootechnical issues. The appearance of several prohibited species of fish that naturally occur in the rivers of Southeast Asia or South American countries is a drastic example of the damage caused to Keralas aquatic ecosystem because of the largely unregulated import of fish to the State for farming and for the ornamental fish industry. There are several emerging diseases for farmed fish in India, particularly for freshwater fish and prawns.&nbsp; The practice of seed import without adequate precautions could bring many new diseases to the aquaculture sector in Kerala.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Lack of suitable feed for freshwater aquaculture</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Groundnut Oil Cake and rice bran remain the most popular feed for the freshwater fish cultured in India. Further, ornamental fish industry still prefers imported feeds due to lack of indigenously- made feeds of good quality. Of late, farmers have begun using formulated feeds in limited quantities.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11681/2.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Capture based ornamental fishery Ornamental fishery is largely restricted to the sale of riverine collection of indigenous varieties alone for international destinations, directly or via the ports in Chennai, Mumbai or Kolkata. It is evident that only a fraction (less than 10%) of the wild caught fish reaches the final destination in the international market, while the rest is lost while transfer from the source of collection, and conditioning before export. The indiscriminate capture of ornamental fish from the wild without adequate replenishment is a serious threat to the biodiversity of the state. The fact that many of these species are listed as vulnerable or endangered in the IUCN Red List of Threatened Species further compounds the problem.&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Lack of value-added aquaculture products</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Most of the freshwater fishes are marketed whole without any processing. No effort has been taken to make value-added products like fish fillets, surimi etc. The floating bones in the flesh of the carps might be the main hindrance to value addition.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Administrative constraints</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">&nbsp;At the national and the state level, aquaculture policies are being established to stimulate development. Many governments have intervened at the macro level by designating aquaculture as a priority area in their economic agendas, defining goals and targets and establishing guiding strategies to achieve them by facilitating reasonable access to credit, providing fiscal incentives and removing institutional constraints. However, in many cases, aquaculture administration still falls under more than one agency, which often hinders progress. This is true for our state also where aquaculture activities are taken up by agencies, the activities of which are often overlapping, and policies are contradictory in many instances.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Prospects for inland aquaculture development in Kerala Despite the many constraints that face the development, freshwater aquaculture in Kerala present a positive outlook. The proven success of extensive paddy cum fish culture in Vietnam and China could be emulated to suit these areas. Measures to improve fish production in the State by expanding farming areas and enhancing productivity of the aquaculture systems are essential.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Although non-endemic in the rivers, the Indian major carps, Chinese carps and common carp have become well established in the waters of Kerala and their propagation need to be encouraged. Endemic species like the pearl spot, (Etroplus suratensis, though exotic, it is at home in Kerala), Manjakoori (Horobagrus brachysoma), the native catfish (Clarias dussumeirii), and Gonoproktopterus curmuca enjoy great preference among Keralites. These species have been shown to grow well, and success achieved in their seed production by the Kerala Agricultural University.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Cage culture in the freshwater reservoirs of Kerala would contribute significantly in augmenting the fish and prawn production from the state, which has a direct bearing on export earnings. The cultivable space could be more effectively enhanced by utilizing the available water area, and facilitating easier harvesting compared to the conventional farming in earthen ponds. Cage culture does not affect the indigenous flora and fauna of the reservoirs or their water flow characteristics, and is therefore ecologically safe. Apart from offering direct employment to rural population, it would also create a new line of rural entrepreneurs, who could be trained to achieve maximum output from the limited resources available, without harming the environment. Cage culture is most suitable for freshwater lakes and reservoirs but may be practiced in any environment suitable for fish culture. It is promising to note that there has been a recent expansion in the cage culture of Karimeen in the fresh and brackish water bodies in some districts of Kerala. Cage culture of Karimeen, common carp, and other suitable fishes should be promoted in the reservoirs and freshwater lakes in the State.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Farming of freshwater prawns</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Unlike the non-endemic carps, the freshwater prawn (M. rosenbergii) is a native of the rivers of Central Kerala and is one of the most suitable species for culture in fresh and low saline waters, either as a monoculture candidate or in polyculture along with carps, milkfish, gray mullet etc. Considerable potential for freshwater prawn farming exists in many parts of Kerala where waterlogged areas are available that are otherwise unsuitable for agriculture. The State has rich resources of wetlands, which remain fallow during major parts of the year. A majority of such areas could be brought under freshwater prawn farming to enhance production and productivity from these fallow water bodies.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11682/3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"6224652292\" data-adsbygoogle-status=\"done\" style=\"width: auto; height: auto;\"><ins id=\"aswift_4_expand\" style=\"display: inline-table; border: none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 0px; background-color: transparent;\"><ins id=\"aswift_4_anchor\" style=\"display: block; border: none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 0px; background-color: transparent; overflow: hidden; opacity: 0;\"><iframe width=\"0\" height=\"0\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_4\" name=\"aswift_4\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 0px; height: 0px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Paddy cum fish/prawn culture</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Rice and prawn integrated culture in alternate crops is an age-old practice in many Southeast Asian countries. Several successful trials have been conducted in China, Vietnam, Indonesia, and the Philippines, which have proven their success. The rice cultivation and prawn culture are mutually beneficial, and enable to enhance the production from unit area without any ecological hazards. Steps should be taken to promote paddy cum fish/prawn culture in the state by suitably modifying the paddy fields wherever possible. The alternate or concurrent culture of rice and fish/prawn would serve to increase the income of farmers while economising the production. The use of fertilizers and pesticides could be eliminated by this system of crop management. The coastal belt of Kerala has a unique system of paddy cultivation in saline soils known locally as Pokkali cultivation. The term Pokkali refers to a salinity resistant rice variety largely cultivated&nbsp; in Central Kerala especially in the Ernakulam district. Pokkali cultivation is fast losing ground due to the non-profitability of operations arising out of low yielding varieties of paddy and the high cost of labour involved. The saline resistant, tall variety of paddy cultivated in pokkali lands offers a unique opportunity to culture freshwater prawns simultaneous with the paddy crop during June to October. The cultivation of high value freshwater prawns along with paddy would make the culture system more sustainable, eco-friendly and economical. The farming of prawns along with Pokkali is mutually beneficial. Left over feed and the excreta of the prawn will act as manure for the paddy, and paddy plants will act as a biofilm for the development of periphyton, which constitute an ideal feed component for the prawn.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Ornamental fish culture</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The state has a rich resource of indigenous ornamental fish in various river systems that have the potential to earn income to the state. Among these fishes, a few like Puntius denisoni are very valuable in the international market. Indiscriminate collection of these fish from the wild is a threat to the biodiversity. A certification system should be introduced for the export of indigenous fishes, to the effect that only captive bred and reared specimens are allowed to be shipped overseas. While regulating the export, the import norms of new varieties of aquarium fish need to be liberal. The nature and requirements of the world ornamental fish trade are quite dynamic. To be competent, new varieties need to be introduced in the international market. The exporter needs to be updated on the current trends and the varieties traded in the prevailing market. Hence, the licenses for importing ornamental fish need to be made liberal to facilitate breeding them in captivity in our local conditions and re-export. Importing limited number of brood stock should be permitted liberally after strict quarantine. Presently, Kerala exports only wild caught fish to the international market. Most of the other exotic ornamental fish are being exported from Chennai, Kolkata and Mumbai. This need a change and the priority should be shifted to exotic varieties and captive bred native fishes. The ornamental plants in aquarium involve a sizeable trade in the international market. These plants should be artificially propagated on a mass scale and explore the market possibilities.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Conservation</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Serious effort to protect the biodiversity is needed in the case of indigenous ornamental fishes and coldwater fishes. In addition there were several recent issues with regard to introduction of exotic species like the African catfish Clarius gariepineus, pacu, gar fish, etc. in Kerala, which has made its way into the country through Bangladesh, or through ornamental fish imports, and are now established in many parts of India. Their recent entry into the open water bodies of Kerala is a major threat to the States aquatic systems. Despite the abundance of rich freshwater resources including rivers, reservoirs, lakes etc. and the presence of two active monsoon periods, the impact of freshwater aquaculture in contributing to the food sector is far less compared to other states like Andhra Pradesh, where water is a scarce commodity. Suitable technologies and methods need to be devised to enhance production and productivity from inland aquaculture, while safeguarding the environment. This would bring about substantial increase in the number of jobs in inland aquaculture. Freshwater fish culture could also serve to enhance depleted wild fish stocks thereby increasing the value of commercial landings for fishermen and enriching the States aquatic inland resources. Paddy cum fish/prawn culture and cage or pen culture of prawns in reservoirs and other suitable water bodies appear to have great potential in augmenting the production from freshwater aquaculture. Since paddy is intimately associated with the life in Kerala, being the staple food, its integration with fish and prawn thereby catering to both domestic as well as export markets could have great influence on the nutrition of the population, apart from increased exports.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '18.jpg', '1', '1546150649', 'Co-operative\'s', '', '', 'Admin', '1'),
(40, '2018-12-30', '11:47:42', 30, 12, 2018, 'Techie-turned-farmer uses Information & Communications Technology for Organic Farming', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Sarathbabu Pintyala is a thirty-year-old successful IT professional, who left his job to follow his passion for farming by avoiding the use of chemical fertilizers as well as pesticides.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">He said, I did a few stints in software companies in Hyderabad for around 7 years after finishing my PG in management from Osmania University and that gave me confidence to start my new venture. &nbsp;Pintyala grows different crops on which he only uses bio-pesticides and bio-fertilisers in Bobbepalli village of Prakasam district.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The farmer efficiently leverages Information &amp; Communications Technology (ICT) right from crop selection to its marketing. And this is the stage when an average farmer struggles to stay buoyant due to low payment that fails to match pace with the rising costs of cultivation.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The techie-turned-farmer utilizes ICT right from choosing the crops to bagging online orders for his organic produce. He has also networked his meadow with micro-irrigation systems because Prakasam district is infamous for being drought-prone.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11855/hyderabad-farmer-kj.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"2002611573\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" __idm_frm__=\"446\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Usually, farmers recognize a crop that has obtained a good price in the previous year and then they go for a large-scale planting of that crop. But, they wind up making losses in the event of a market crash.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Sarathbabu grows around 10 varieties of crops at the same time in his 10-acre land. And each crop is cultivated in about 50 cents of land to reduce the risk associated with mono-cropping.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In an interview with&nbsp;<em>The Hindu</em>&nbsp;the techie farmer said, I take yields throughout the year to cut the risk as the prices of crops fluctuate depending upon the demand and supply at a particular point of time.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '215.jpg', '1', '1546150662', 'Success_Stories', '', '', 'Admin', '1'),
(41, '2018-12-30', '11:48:24', 30, 12, 2018, 'You can earn 13 lakhs in 10 months through Capsicum Farming', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Vijayrao is a successful capsicum farmer from Kadbanwadi village in Punes Indapur taluka. His village was once counted amongst 300 nondescript drought-prone villages in Maharashtra, but now it has 100 farm ponds, 110 earthen bunds, 27 cement nala bunds and 3 percolation tanks. And all this is because of his fathers hard work. Vijayraos father was a retired teacher and a dedicated farmer, who made his village drought-proof.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Vijayrao after finishing his B.Sc in Agriculture in 2010 decided to work for the Maharashtra Public Service Commission. He struggled for two years, gave many interviews but couldnt succeed in getting a job. So he went back to his village and started working at a petrol pump. Soon he realized that in this way he was wasting his agricultural degree.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The farmer told that he couldnt start traditional farming as it wasnt economically viable. And he had learned about polyhouse farming or controlled farming. Polyhouse farming is basically a controlled and protected way of farming inside a structure, where various flowers and vegetables can be grown. Crops in a polyhouse mature irrespective of the weather conditions, as the atmosphere can be artificially managed with motorized screens and ventilators to facilitate crop growth. Moreover, the poly film on the set up doesnt allow even a drop of rainwater to enter it.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Vegetables such as tomatoes, cabbages, cucumbers, strawberries, bottle gourds and capsicums and flowers like roses and carnations can be easily grown in a polyhouse. The initial cost of setting up no doubt is high but it increases the life cycle of the crop, produces better yield and is water-efficient.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11104/red-capsicum.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">When asked about how he started his polyhouse, Vijayrao told that after attending a one-week workshop at the Horticulture Training Centre in Pune, he applied for a loan of Rs 30 lakh from the bank. Soon he established a polyhouse in a one-acre land at Shelgaon in February 2018.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">After doing some market research, he decided to grow colored capsicum particularly the yellow and red ones. The first harvest was in the middle of April, where he obtained Rs 35 to 40/kg. And today, he earns Rs 170/ kg for these capsicums. He not only exports capsicum in Pune but also to Mumbai and Delhi.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Additionally, his notable work in the polyhouse was examined by government officials from the agriculture department, giving him a subsidy of Rs 18 lakh.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">He told that setting up a polyhouse is a costly investment in the beginning but slowly it will help you recover all your expenses and also give you good returns. He explained that once you sow the saplings, they have a life cycle of about a year and can bear around 40 tonnes of produce.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Vijayraos polyhouse has yielded 30 tonnes in 10 months (February to December) and he has managed to earn 13 lakhs in this short period. &nbsp;The polyhouse also attracts a number of farmers from across the district, seeking guidance and information.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '6.jpg', '1', '1546150704', 'Success_Stories', '', '', 'Admin', '1'),
(42, '2018-12-30', '11:49:09', 30, 12, 2018, 'Earn 1.5 Lakhs in 10 months with this Wonder Grass', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The wonder grass of Tamil Nadu known as Vetiver, which has a broad range of application in the cosmetic and pharma industries, besides anti-soil erosion properties, is slowly spreading roots in the State.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Vetiver, which grows up to 5 feet and whose aromatic root reaches up to 10 feet, has a big demand in the global aromatic industry. The grass is famous for its quality to fight soil erosion and absorb carbon dioxide, thus removing carbon footprints. In the past few years, niche products have been made with this wonder grass by value addition.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The grass is perfect for the long shoreline or coast as it is suitable for sandy soil, told C.K. Ashok Kumar from the India Vetiver Network. It must be noted that the network is involved in popularizing Vetiver farming in association with Tamil Nadu Agricultural University.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Ashok, who has been encouraging the youth especially those in fishing hamlets said, It is easy to harvest this plant, which brings very high returns. The huge coastline can be utilised in raising vetiver in a big way.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">This wonder grass can also be used to purify contaminated water bodies, particularly temple tanks and to seize soil erosion in ghat sections of Kerala and Kodaikanal.</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10793/farmers-with-grass.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Pandian, who cultivates vetiver grass on his 10-acre ranch in Kuruvadipatti village of Sivaganga district said, The grass is now a favourite among inland farmers as well. The yield is low as compared to coastal areas but the quality of grass is high.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Against a produce of 2 to 2.5 tonnes /acre in coastal areas, inland farmers obtain 1.5 lakh tonnes. Moreover, essential oil recovery is 0.8 percent in coastal grass and 1.49 percent in inland grass. And 1 kg of essential oil brings between Rs 30,000 to 58,000.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Pandian further told that 1 kg of vetiver produces 300 grams of oil and it is possible to earn over Rs. 1.5 lakh/acre, excluding all expenditure over 10 months period. &nbsp;He said the moisture preservation property of vetiver makes it a natural choice for soil conservation as well as replenishment of ground water. It is perfect for dry land farming with the use of organic farming practices, said Pandian.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The wonder grass is also used in extraction of ethanol, as cattle food and for making handicrafts. Last but not the least vetiver is an anti-depressant.</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '17.jpg', '1', '1546150749', 'Success_Stories', '', '', 'Admin', '1');
