(43, '2018-12-30', '11:49:28', 30, 12, 2018, 'Black Diamond of the Earth', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Among truffles, there are two broad categories &nbsp;the black truffle (Tuber&nbsp;melanosporum) and&nbsp;the&nbsp;white&nbsp;truffle (Tuber magnatum)&nbsp;Truffles are highly sought after, and therefore&nbsp;they can be incredibly&nbsp;expensive.&nbsp;White truffles&nbsp;fetch jaw dropping prices in auctions!&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The indiscriminate capture of ornamental fish from&nbsp;the wild without adequate replenishment is a serious&nbsp;threat to the biodiversity of the state&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Land Treasure&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Truffles with the sobriquet black&nbsp;gold or&nbsp;black&nbsp;diamond of the earth is the&nbsp;subterranean, edible,&nbsp;nearly globose, fruiting body of the Ascomycete&nbsp;fungus of the genus&nbsp;Tuber, grown&nbsp;symbiotically&nbsp;on specific tree roots. Truffles are highly priced&nbsp;for its culinary value so much so that it is called&nbsp;as the diamond of the kitchen. Edible truffles&nbsp;are held in high esteem in French, Croatian,&nbsp;Georgian, Bulgarian, Greek, Italian, Middle&nbsp;Eastern, and Spanish cuisine, as well as in&nbsp;international haute&nbsp;cuisine.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Indian Perspective&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In India, truffles are rather arcane. But as more&nbsp;and more Indians are travelling to western&nbsp;countries, its becoming familiar in the country&nbsp;and the demand is increasing. Recently ITC&nbsp;Grand&nbsp;Chola&nbsp;organised&nbsp;a truffles tour at Chennai.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Morphometry&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Truffles can reach 12 cm (5 in) diameter and&nbsp;weigh around 500 g. However, some truffles may&nbsp;be significantly larger weighing more than one kg.&nbsp;In December 2014, a white truffle weighing 4.16&nbsp;pounds or 1.89 kilograms was unearthed in the&nbsp;Umbrian region of Italy. Truffles are more or less&nbsp;globose in shape.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Black, White and Other Truffles&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Among truffles, there are two broad categories&nbsp; the black truffle (Tuber&nbsp;melanosporum) and&nbsp;the white&nbsp;truffle (Tuber magnatum). The black&nbsp;truffle (Prigord truffle or French black&nbsp;truffle)is&nbsp;generally smaller than its white counterpart, but is&nbsp;more&nbsp;common .Black&nbsp;truffles, also referred to as&nbsp;the black diamond of the earth, were originally&nbsp;found across Europe but now spread to many&nbsp;other countries.&nbsp;The white truffle (Truffle of the White Madonna&nbsp;in Italian) is found mainly in Italy and&nbsp;France .A&nbsp;slightly different variety of white truffle has also&nbsp;been found in the USA, Qatar and some other&nbsp;Middle East countries.&nbsp;However, the&nbsp;Italian&nbsp;white truffles are the best and most valuable one&nbsp;in the&nbsp;market.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11675/2.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Taste&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">There are lots of different ways to describe the&nbsp;flavor and odor of&nbsp;truffles,&nbsp;but generally it is&nbsp;described as slightly garlicky with a deep musky&nbsp;aroma. Its very earthy and&nbsp;pungent.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Host Trees&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Truffles grow at a depth of 5 cm (2.0 in) to 50 cm&nbsp;(20 in) as&nbsp;ectomycorrhizae,&nbsp;colonising&nbsp;on the&nbsp;roots of their host trees such as holm oaks, French&nbsp;oaks, hazel, beech, birch,&nbsp;pine, cherry&nbsp;and&nbsp;other deciduous trees. In the United States, they&nbsp;can sometimes be found growing with pecan trees&nbsp;too. However, in Qatar, the&nbsp;favoured&nbsp;host plant&nbsp;is the desert sunflower growing up to a height&nbsp;of&nbsp;one meter.&nbsp;Black truffles sometimes suppress the growth&nbsp;of plants around their symbiont, creating the&nbsp;impression of a burnt area around it. They do so&nbsp;by parasitizing the roots of other plants, which&nbsp;may lead to necrosis of the root bark and the&nbsp;death of the host plants.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Production&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">France accounted for about 45% of the world&nbsp;production of black truffles followed by, Spain&nbsp;(35%) and Italy (20%). But now Australia, New&nbsp;Zealand and USA are also in the fray. Smaller&nbsp;amounts are produced in Slovenia, Serbia and&nbsp;Croatia. The European Union funded Rural&nbsp;Development&nbsp;Programme&nbsp;provides subsidy&nbsp;for truffle culture and has a visible effect in&nbsp;production since 2010-2011.&nbsp;Total production was 448MT during 2013-14 from&nbsp;Spain, France, Italy and European Union together&nbsp;while Australia produces around 600kg.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Treasure Hunt&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Trained animals like pigs and dogs with&nbsp;strong olfactory prowess are&nbsp;used, though&nbsp;not exclusively, to locate and track down the&nbsp;subterranean pungent culinary delight and&nbsp;unearth them from the leaf litter and soil.&nbsp;Unfortunately&nbsp;as pigs devour the located treasure,&nbsp;now-a-days, dogs&nbsp;which are trained from very&nbsp;young age, are preferred for hunting the truffle.&nbsp;These animals locate the truffles attracted by the&nbsp;odour&nbsp;of some compounds the fungi emit.&nbsp;In Italy, the use of the pig to hunt truffles&nbsp;has been prohibited since 1985 because of&nbsp;damage caused by the animal to the truffle&nbsp;ecosystem during the digging that shackles the&nbsp;production rate.&nbsp;In Qatar, the entire family does the hunting without&nbsp;the help of any animals.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Truffle Troubles&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">War over truffles is very common in Albanias&nbsp;(South Eastern Europe) forests by rival groups&nbsp;during the truffle season. The hunter dogs are&nbsp;poisoned and host trees are&nbsp;destroyed .Reckless&nbsp;hunters attack the forest land with pickaxes and&nbsp;sharp spades destroying the root system of the&nbsp;host trees and thereby killing the golden goose!&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11676/3.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><span style=\"font-weight: 700; color: rgb(18, 18, 18); font-size: 17px;\">Propagation&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Boars and the larvae of the truffle fly (Suillia&nbsp;tuberiperda), which eat the fruiting bodies, aid&nbsp;in the distribution of the species by excreting the&nbsp;indigestible&nbsp;spores. Cultured&nbsp;fungal mycelium or&nbsp;spores&nbsp;is&nbsp;used as the inoculums in truffle culture.&nbsp;</span><span style=\"font-weight: 700; color: rgb(18, 18, 18); font-size: 17px;\">Truffle Farming&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Though some&nbsp;amount&nbsp;of truffles are still&nbsp;collected from the wild sources, cultivated truffles&nbsp;form a major chunk of production now. Truffle&nbsp;culture or cultivation of truffles has its beginning&nbsp;in the 19th&nbsp;century but it got sidelined or neglected&nbsp;for most part of the 20th&nbsp;century.&nbsp;However, during&nbsp;the last 35 years, again scientific cultivation of&nbsp;truffles gained momentum. Black truffles are now&nbsp;cultivated in Australia, France, New Zealand,&nbsp;Chile, Sweden, United Kingdom, USA, and&nbsp;South&nbsp;Africa.&nbsp;Cultivation involves the planting&nbsp;and establishing of the host tree orchards and&nbsp;inoculation of the host rhizosphere with truffle&nbsp;mycelium. A critical phase of the cultivation is&nbsp;the quality control of the mycorrhizal plants.&nbsp;Before inoculating the truffle mycelia, other&nbsp;contaminating soil fungi in the rhizosphere of&nbsp;the host plants are to be controlled to ensure the&nbsp;establishment of the truffle mycelia and success&nbsp;of the plantation. Once the rhizosphere is cleared&nbsp;off the competing fungi, then the truffle mycelia&nbsp;culture is inoculated to the root zone of the host&nbsp;tree.&nbsp;Well drained argillaceous or calcareous soils with&nbsp;neutral or alkaline pH are ideal for truffle farming.&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Truffles dont like the extremes of temperature, or&nbsp;extremes of moisture.&nbsp;It takes between 7 and 10 years for the truffles&nbsp;to develop their mycorrhizal network, and only&nbsp;after that the host-plants come into production&nbsp;of the fruiting bodies, the culinary delight. Total&nbsp;investment per hectare for an irrigated and fenced&nbsp;plantation (against wild boars) can cost up to&nbsp;10,000(about Rs. 8 lakhs).&nbsp;Few big companies are now in to the business of&nbsp;truffle&nbsp;production.A&nbsp;Western Australian venture,&nbsp;The Truffle &amp; Wine Company, had its first harvest&nbsp;in 2004, and in 2005 they dug up a 1 kg truffle.&nbsp;In 2008, an estimated 600 kilograms of truffles&nbsp;were produced at&nbsp;Manjimup, Western&nbsp;Australia.&nbsp;However, in 1999, the first Australian truffles&nbsp;were harvested in Tasmania from&nbsp;a&nbsp;eight year old&nbsp;plantation, while in June&nbsp;2010, the&nbsp;Tasmanian&nbsp;growers harvested Australias largest truffle&nbsp;weighing 1.084 kilograms and was valued at&nbsp;about A$1,500 per kg.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Prior to this, Gisborne in&nbsp;New Zealand recorded the first harvest of truffles&nbsp;from the inoculated trees in the year 1993.&nbsp;New World&nbsp;Truffieres&nbsp;is a North American&nbsp;company engaged in transfer of technology of&nbsp;truffle production including&nbsp;myceila&nbsp;(spore)&nbsp;culture and inoculation as well as orchard raising&nbsp;and management to farmers in USA besides&nbsp;successfully producing the commodity since&nbsp;2000 in orchards of oak and hazelnut. They also&nbsp;organize annual meet of the growers.&nbsp;Eighty percent of the truffles now produced&nbsp;in France come from specially planted truffle&nbsp;groves. The fruiting bodies develop from April&nbsp;to June, and are harvested during November to&nbsp;March.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Truffle Trade&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Truffles are highly sought after, and therefore&nbsp;they can be incredibly&nbsp;expensive.&nbsp;White truffles&nbsp;fetch jaw dropping prices in auctions! The record&nbsp;price paid for a single white truffle unearthed&nbsp;from Pisa, Italy was $330,000 in 2007, auctioned&nbsp;simultaneously at Macau, Hong Kong and&nbsp;Florence. As&nbsp;of December 2009 the price of&nbsp;white truffles&nbsp;was&nbsp;$14,203.50 per kg. However,&nbsp;in December 2014, a white truffle weighing&nbsp;1.89 kilos in the Umbrian region of Italy and&nbsp;was auctioned in New York for $61,000 to a&nbsp;Taiwanese buyer!&nbsp;However, the&nbsp;record price paid&nbsp;for a single white truffle was set in December&nbsp;2007, when Macau casino owner Stanley Ho paid&nbsp;a whopping $330,000 (165,000) for a specimen&nbsp;weighing 1.5&nbsp;kilograms !.</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">With a price of about&nbsp;1,000 to 2,000 euros per kilogram, black truffles&nbsp;are the second most expensive truffles after white&nbsp;truffles, and one of the most&nbsp;sought after&nbsp;edible&nbsp;mushrooms in the world.&nbsp;The largest truffle market in France (and probably&nbsp;also&nbsp;in the world) is at&nbsp;Richerenches&nbsp;in Vaucluse.&nbsp;These markets are busiest in the month of&nbsp;January, when the black truffles have their highest&nbsp;perfume. A&nbsp;cheap inferior quality Chinese truffles&nbsp;are found creating havoc in truffle trade.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11679/white-truffle.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"6224652292\" data-adsbygoogle-status=\"done\" style=\"width: auto; height: auto;\"><ins id=\"aswift_4_expand\" style=\"display: inline-table; border: none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 0px; background-color: transparent;\"><ins id=\"aswift_4_anchor\" style=\"display: block; border: none; height: 0px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 0px; background-color: transparent; overflow: hidden; opacity: 0;\"><iframe width=\"0\" height=\"0\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_4\" name=\"aswift_4\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 0px; height: 0px;\"></iframe></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Culinary uses&nbsp;</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Because of their high price and pungent aroma,&nbsp;truffles are used sparingly. Fresh black truffles&nbsp;or preserved in light brine, are used to refine the&nbsp;taste of meat, fish, soups and risotto. Unlike&nbsp;white truffles, the aroma of black truffles does&nbsp;not diminish when heated, but becomes more&nbsp;intense. In Spain, where black truffles have a&nbsp;strong prominence, one truffle dish is known as&nbsp;blanched eggs, or huevos&nbsp;escaldados&nbsp;in Spanish&nbsp;.The&nbsp;flavour&nbsp;of black truffles is far less pungent&nbsp;and more refined than that of white truffles.&nbsp;Their strong&nbsp;flavour&nbsp;is often described as syrupy&nbsp;sweet. Black truffles also are used for producing&nbsp;value added&nbsp;salt(truffle salt) and honey(truffle&nbsp;honey).</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">White truffles are generally served raw&nbsp;and shaved over steaming buttered pasta, salads,&nbsp;or fried eggs. White or black paper-thin truffle&nbsp;slices may be inserted into meats, under the skins&nbsp;of roasted fowl, in foie&nbsp;gras&nbsp;preparations, in pts,&nbsp;or in&nbsp;stuffings. Some specialty cheeses contain&nbsp;truffles as well. While in the&nbsp;past ,chefs&nbsp;used to&nbsp;peel truffles, in modern times, most restaurants&nbsp;brush the truffle carefully and shave it or dice&nbsp;it with the skin on so as to make the most of&nbsp;this valuable ingredient. A few restaurants in&nbsp;Switzerland still stamp out circular discs of truffle&nbsp;flesh and use the skins for sauces.&nbsp;Adulteration or substitution of genuine truffles&nbsp;with inferior quality Chinese truffles is posing a&nbsp;problem to the trade and foodies.&nbsp;</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '19.jpg', '1', '1546150768', 'Co-operative\'s', '', '', 'Admin', '1'),
(44, '2018-12-30', '11:50:01', 30, 12, 2018, 'KVK Sivaganga that Leads the Way', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Sivaganga&nbsp;(Kundrakudi) ICAR-&nbsp;Krishi&nbsp;Vigyan&nbsp;Kendra (KVK) is&nbsp;about 10 kilometer from&nbsp;Karaikudi&nbsp;of&nbsp;Sivaganga&nbsp;district. It is one of the best KVKs of Tamil Nadu&nbsp;that comes under Tamil Nadu Veterinary and Animal Science University. It provides training to hundreds of farmers&nbsp;every&nbsp;month and gives technical support to farmers irrespective&nbsp;of&nbsp;their&nbsp;district or state.&nbsp;The total area of KVK is 17 acres and the training facility and incubation centers are spread across the compound.&nbsp;KVK mentored many,&nbsp;but&nbsp;I&nbsp;like to introduce a few very successful farmers&nbsp;here.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Natchiyappan, a retired bank employee is one among them. He took advice from KVK and started pure organic farm having&nbsp;mango, lemon, banana,&nbsp;sapota,&nbsp;amla&nbsp;etc. He prepares organic&nbsp;amla&nbsp;juice as a value-added product.&nbsp;It is in big demand and cost Rs.200 per bottle.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10585/discussion-with-sendur.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Another successful farmer is&nbsp;Murukesan&nbsp;of&nbsp;Karumkulam&nbsp;near the famous&nbsp;Kaliyarkovil. He is having a farm of 300 acres, mainly of&nbsp;Alphonso&nbsp;mango. Normally,&nbsp;alphonsa&nbsp;needs a lower temperature of 20 degree&nbsp;celcius&nbsp;at night and hence, not viable for&nbsp;Sivaganga&nbsp;area. But, he tried and succeeded. He made&nbsp;a pond of one acre and established a rain water harvesting plant. He is having another 100 acre land that was developed under social forestry scheme by planting red sandal, mahogany etc. Rs.10 lakh was given by social forestry&nbsp;department.&nbsp;The&nbsp;mini&nbsp;forest&nbsp;made a change in its micro climate. Earlier, that area was unfit for cultivation, but now flourished with coconut, banana and vegetables.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Annamalai, the owner of Emerald&nbsp;tyres&nbsp;,&nbsp;is another successful farmer having 500 acres of land in&nbsp;Katatchi&nbsp;village near&nbsp;Kaliyarkovil. His farm is rich with 1000 mango trees, coconut and&nbsp;amla&nbsp;as main crops and the cultivation is organic .He started Emerald organic fertilizers and well established in a short span of time. The product is now going&nbsp;abroad ,&nbsp;mainly to China and Sri Lanka. Emerald recently started production of liquid fertilizers&nbsp;too.&nbsp;&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/10586/kvk-campus.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Annamalai&nbsp;Chettiyar&nbsp;near&nbsp;Kileseval&nbsp;patti, who has cultivations of 45 acres is an engineer turned farmer, who has 40 acre of mango&nbsp;and&nbsp;poly&nbsp;house&nbsp;for cucumber cultivation. He made&nbsp;polyhouse&nbsp;with the support of Government subsidy of 50%&nbsp;and&nbsp;that came to around Rs.467/-&nbsp;per&nbsp;square meter. His engineering back ground&nbsp;helped him to start a poly house making firm also. He got Government approval for providing subsidy to his makings.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Dairy is the major sector of&nbsp;Sivaganga, as the water&nbsp;shortage back track&nbsp;those in agriculture. In 2008-09, the total production of milk was 35,000 liters only.&nbsp;Then, the District collector,&nbsp;Siddik&nbsp;made an inquiry and found&nbsp;out that the number of cattle was less and it was due to lack of&nbsp;proper&nbsp;insemination. He&nbsp;made&nbsp;a&nbsp;project to provide training to science graduates in artificial insemination and that campaign clicked. Now, the&nbsp;population of cows is&nbsp;on the higher side and the milk is more than needed for consumption. At present, the challenge is that of the storage&nbsp;of&nbsp;excess&nbsp;milk.&nbsp;Sivaganga&nbsp;has only one chilling plant and Government plans for one more. To overcome the present crisis, KVK gives training to farmers for making value&nbsp;added&nbsp;products&nbsp;from milk.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Since&nbsp;Sivaganga&nbsp;is a drought prone district, National Horticultural&nbsp;Mission provides 2 to 5&nbsp;crore&nbsp;subsidy for perennial crops.&nbsp;Availability&nbsp;of&nbsp;good water is the major problem. Studies proved that&nbsp;upto&nbsp;30 feet&nbsp;deep,&nbsp;the water is salty.&nbsp;In certain places, obtains water after bore 60 to 100 feet. Mitigation of salt water is a headache and the KVK is trying to implement&nbsp;electro magnetic&nbsp;field technology to solve the problem. In&nbsp;electro magnetic&nbsp;field technology, sodium chloride can be separated as sodium and chlorine.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Thirunavukarasu&nbsp;of&nbsp;Sonasri&nbsp;organic fertilizers have its production unit at&nbsp;Sonipatti. They use sugar factory waste for making bio fertilizers. It all started after the villagers of&nbsp;Muthukudi&nbsp;protested against sugar companies who dumped the waste into their village. He took interest in procuring the waste and making it as organic manure in large scale. Now, he earns&nbsp;Rs. 40 -50 lakhs per annum from his company. He is having 5 acres of banana&nbsp;cultivation&nbsp;also. He is a specialist in tray seedlings supply too. About 3000- 4000 people visit his farm per annum.&nbsp;&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Don&nbsp;Bosco&nbsp;goat farm is another successful&nbsp;venture that&nbsp;is in&nbsp;Salai&nbsp;gramam&nbsp;of&nbsp;Ilayamgudi&nbsp;block. The owner is a gulf returnee who took advice from KVK and started goat farm of&nbsp;&nbsp;Kodi&nbsp;aadu and Kanni&nbsp;aadu .&nbsp;Muthaiyya&nbsp;of&nbsp;Kallad&nbsp;is a central government award winner who successfully managing a piggery farm. Obtaining hotel waste was a big&nbsp;problem&nbsp; for&nbsp;him. District Collector directed municipalities to provide all hotel waste&nbsp;free&nbsp;of cost to the piggery and now&nbsp;Muthaiyya&nbsp;is a happy man and municipality officials are also happy as the burden of bio waste is reduced drastically.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">There are hundreds of success stories among small&nbsp;farmers, said&nbsp;Dr. Sendur&nbsp;Kumaran,&nbsp;Kundrakudi&nbsp;KVK head. The total staff of KVK is 16, out of that 9 are ministerial staff, 6 scientists and one head scientist. Scientists are from various fields like veterinary, agronomy, horticulture, soil science, home science and fisheries.&nbsp;Indeed,&nbsp;fishery is&nbsp;one of the established fields in&nbsp;Sivaganga&nbsp;as 8400 ponds were made under DRDA and MNREGA schemes. The major cultivations are that of&nbsp;catla,&nbsp;rohu,&nbsp;mirgal&nbsp;and gift tilapia.&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Sendur&nbsp;Kumaran&nbsp;is a good captain of KVK. He is a&nbsp;Ph.D&nbsp;in vegetable science and M.Sc in Pea Breeding. He has done research in Belgium based hydrophilic polymer&nbsp;in&nbsp;tomato.&nbsp;He was part of the team which introduced hydrogel in India for the first time.&nbsp;&nbsp;</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '218.jpg', '1', '1546150801', 'Success_Stories', '', '', 'Admin', '1'),
(45, '2018-12-30', '11:50:45', 30, 12, 2018, 'The Nutrition in Guava', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Fruits are borne on current seasons growth of Guava tree. Fertilizers encourage vegetative growth, further leads to increased flowering and fruiting. The time of fertilizes application depends upon choice of Bahar to be harvested. Winter crop is more remunerative and fertilizers are generally aimed at getting beneficial effect to these crops.&nbsp;&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11429/guava-plant.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Nutrition in Guava</span></h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">The nutritional requirement of Guava after fruiting varies with region to region, soil type, and age. A dose 50 Kg. well decomposed organic manure, 978 g. Urea (450 g. N), 1875 g. Single Supper Phosphate (300 g. P) and 500 g. Murate of potash (300 g. K.) to be applied during monsoon season. Fertilizers are applied in basins by the ring or drip point at a depth 15 to 20 cm. Area around the active root zone is at 30 cm. from the trunk at a depth 30 cm. Split dose of Urea @ 978 g.&nbsp;<br>(450 g. N) per plant to be applied in October to November.&nbsp;&nbsp;<span style=\"font-weight: 700;\">(Directorate of Extension Education, MPKV, Rahuri,&nbsp;<em>Krushidarshni,</em>&nbsp;2018).</span></p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11431/manuring-guava.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Spraying of 50 g. Urea through 15 liters of water to the plants during March and October are recommended for adequate growth and development.</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px; font-weight: 700;\">(Book, Fruit crops by K. V. Peter).&nbsp;&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Spraying of zinc sulphate, magnesium sulphate, manganese sulphate and copper sulphate each @ 0.5 percent (5 g. per liter of water) at the time of new flush and blooming respectively, to correct zinc, magnesium, copper and manganese deficiency</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px; font-weight: 700;\">(Book, Fruit crops by K. V. Peter).&nbsp; &nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Authors</span></p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Dr. Sable P.&nbsp; A. (Scientist, Horticulture), Dr. A. S. Sheikh. (Sr. Scientist and Head) KVK, Sabarkantha, Sardarkrushinagar Dantiwada Agricultural University, S.K. Nagar, Gujarat and Sonpure Sushma, Sr. Ph.D. Scholar, (Agronomy), MPKV.,<br>Rahuri, Maharashtra.<br><a href=\"mailto:Sable.pating@gmail.com\" style=\"color: rgb(0, 0, 0);\">sable.pating@gmail.com</a>&nbsp;and Mob. No.&nbsp;<span style=\"font-weight: 700;\">8408035772</span></p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '20.jpg', '1', '1546150845', 'Co-operative\'s', '', '', 'Admin', '1'),
(46, '2018-12-30', '11:52:35', 30, 12, 2018, 'Nutrient Management in Banana (1)', NULL, NULL, '', NULL, NULL, NULL, NULL, '<p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">In India,&nbsp;Banana&nbsp;is grown in about&nbsp;858 000&nbsp;hectare&nbsp;area with an annual production of&nbsp;29163 000&nbsp;tons. It is&nbsp;largely distributed&nbsp;in Karnataka&nbsp;(area&nbsp;101.53 000&nbsp;ha.)&nbsp;and&nbsp;highest&nbsp;production&nbsp;4186 000&nbsp;tons&nbsp;in Gujarat.&nbsp;&nbsp;(<span style=\"font-weight: 700;\">Anon, 2017-18).</span></p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11425/banana-farming-1.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"2002611573\" data-ad-format=\"link\" data-full-width-responsive=\"true\" data-adsbygoogle-status=\"done\" style=\"display: block; height: 90px;\"><ins id=\"aswift_2_expand\" style=\"display: inline-table; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><ins id=\"aswift_2_anchor\" style=\"display: block; border: none; height: 90px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 620px; background-color: transparent;\"><iframe width=\"620\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_2\" name=\"aswift_2\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 620px; height: 90px;\"></iframe><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">Banana is a highly remunerative crop. Planting of Banana&nbsp;is done with sward shape&nbsp;suckers. The suckers should be 500 to 750 g. in weight and of 3 to 4 months old.&nbsp;&nbsp;The suckers&nbsp;should bear&nbsp;3 to 4 rings.&nbsp;While,&nbsp;planting&nbsp;suckers&nbsp;to be&nbsp;dipped in&nbsp;the solution of Imidacloprid (17.8 SL.) 0.5 ml. and Mencozeb 3 g. per liter of water for 15 minutes.&nbsp;(</span><span style=\"color: rgb(18, 18, 18); font-size: 17px; font-weight: 700;\">Anon., 2018).</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;For&nbsp;precocious bearing and uniform harvesting,&nbsp;Banana may be planted by tissue&nbsp;culture seedlings. The seedlings should be 30 to 45 cm in height with 6 leaves.&nbsp;(</span><span style=\"color: rgb(18, 18, 18); font-size: 17px; font-weight: 700;\">Anon., 2018).&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">When, Banana planted&nbsp;at proper spacing with adequate nutrient management gives higher yield and quality production.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11426/dr-subhaschand-2.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_3_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_3_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><iframe width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" vspace=\"0\" hspace=\"0\" allowtransparency=\"true\" scrolling=\"no\" allowfullscreen=\"true\" id=\"aswift_3\" name=\"aswift_3\" style=\"left: 0px; position: absolute; top: 0px; border-width: 0px; border-style: initial; width: 336px; height: 280px;\"></iframe><span style=\"font-size: 24px; font-weight: 700;\">Banana&nbsp;Nutrition&nbsp;</span><span style=\"font-size: 24px;\">&nbsp;</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">The nutritional requirement of Banana varies with region to region, soil type, and age etc.&nbsp;30 Kg. well decomposed organic manure or 5 Kg. Vermicompost&nbsp;to&nbsp;be&nbsp;applied&nbsp;per plant&nbsp;before planting. At planting, for better Nitrogen fixation and Phosphorus viability 25 g.&nbsp;Azospirillum&nbsp;and 25 g. PSB should be applied per plant through compost.&nbsp;&nbsp;</span></ins></ins></ins></div><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Nutrient&nbsp;management&nbsp;in Banana&nbsp;to&nbsp;be done as&nbsp;per schedule given bellow, the&nbsp;dose may be&nbsp;varies&nbsp;as per Soil analysis report.&nbsp;</p><figure style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><img src=\"https://krishijagran.com/media/11427/farmer-scientist.jpg\" style=\"max-width: 100%; margin: 10px 0px; border-radius: 2px;\"></figure><div class=\"article-ad\" style=\"color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><ins class=\"adsbygoogle CM_KJ_WC_Top_Resp\" data-ad-client=\"ca-pub-3463764223457257\" data-ad-slot=\"9181988129\" data-adsbygoogle-status=\"done\" style=\"display: inline-block; width: 336px; height: 280px;\"><ins id=\"aswift_4_expand\" style=\"display: inline-table; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><ins id=\"aswift_4_anchor\" style=\"display: block; border: none; height: 280px; margin: 0px; padding: 0px; position: relative; visibility: visible; width: 336px; background-color: transparent;\"><span style=\"color: rgb(18, 18, 18); font-size: 17px; font-weight: 700;\">Fertilizer management in Banana (g. /plant)</span><span style=\"color: rgb(18, 18, 18); font-size: 17px;\">&nbsp;</span><br></ins></ins></ins></div><table border=\"0\" width=\"0\" style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: Poppins, sans-serif;\"><tbody><tr><td width=\"57\" style=\"width: 61px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">Sr. No.&nbsp;</span>&nbsp;</p></td><td width=\"129\" style=\"width: 189px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">Application time&nbsp;</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">Urea</span>&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">SSP</span>&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">MOP</span>&nbsp;</p></td></tr><tr><td width=\"57\" style=\"width: 61px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">1&nbsp;</p></td><td width=\"129\" style=\"width: 189px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">Planting to 30 DAP</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">80-82&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">350-400&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">80-85&nbsp;</p></td></tr><tr><td width=\"57\" style=\"width: 61px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">2&nbsp;</p></td><td width=\"129\" style=\"width: 189px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">75 DAP</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">80-82&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">-&nbsp;</p></td></tr><tr><td width=\"57\" style=\"width: 61px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">3&nbsp;</p></td><td width=\"129\" style=\"width: 189px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">120 DAP</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">80-82&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">-&nbsp;</p></td></tr><tr><td width=\"57\" style=\"width: 61px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">4&nbsp;</p></td><td width=\"129\" style=\"width: 189px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">165 DAP</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><