); line-height: 25px;\"><span style=\"font-weight: 700;\">300 DAP</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">35-40&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\">80-85&nbsp;</p></td></tr><tr><td colspan=\"2\" width=\"186\" style=\"width: 250px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total</span>&nbsp;</p></td><td width=\"105\" style=\"width: 73px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">430-450</span>&nbsp;</p></td><td width=\"86\" style=\"width: 70px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">350-400</span>&nbsp;</p></td><td width=\"75\" style=\"width: 79px;\"><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px;\"><span style=\"font-weight: 700;\">320-340</span>&nbsp;</p></td></tr></tbody></table><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">DAP-Days after planting&nbsp;<span style=\"font-weight: 700;\">Anon., 2018.</span>&nbsp;</p><h3 style=\"font-family: Poppins, sans-serif; color: rgb(51, 51, 51); letter-spacing: normal;\"><span style=\"font-weight: 700;\">Micronutrient management&nbsp;</span>&nbsp;</h3><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">At&nbsp;2<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">nd</span>&nbsp;and 4<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">th</span>&nbsp;months&nbsp;of&nbsp;plantation, Banana plant&nbsp;to&nbsp;be sprayed with&nbsp;ferrous&nbsp;sulphate and&nbsp;zinc&nbsp;sulphate @ 5 g. per liter of water.&nbsp;On&nbsp;5<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">th</span>&nbsp;and 7<span style=\"position: relative; font-size: 12.75px; line-height: 0; vertical-align: baseline; top: -0.5em;\">th</span>&nbsp;month&nbsp;15 g&nbsp;&nbsp;ferrous&nbsp;sulphate and&nbsp;zinc&nbsp;sulphate&nbsp;to&nbsp;be applied per plant through 100 to&nbsp;150 g.&nbsp;of&nbsp;compost&nbsp;to correct the ferrous and zinc deficiency.&nbsp;(<span style=\"font-weight: 700;\">Anon., 2018).&nbsp;</span>&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\"><span style=\"font-weight: 700;\">Reference:&nbsp;</span>&nbsp;</p><p style=\"font-size: 17px; color: rgb(18, 18, 18); line-height: 25px; font-family: Poppins, sans-serif;\">Anonymous (2018).&nbsp;Directorate of Extension Education,&nbsp;Mahatma&nbsp;Phule&nbsp;Krishi&nbsp;Vidyapeeth,&nbsp;&nbsp;<br>Rahuri&nbsp;(MS).&nbsp;<em>Krushidarshni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</em>&nbsp;<br>Anonymous, 2017.&nbsp;Horticulture Statistics Division,&nbsp;Department of Agriculture, Cooperation&nbsp;and&nbsp;&nbsp;<br>Farmers Welfare,&nbsp;Ministry of Agriculture&nbsp;and&nbsp;Farmers Welfare,&nbsp;Government of India. Pp. 178-79.&nbsp; &nbsp;</p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n', '1', '', '1', '1546150955', 'Co-operative\'s', '', '', 'Admin', '1'),
