(81, '2019-07-29', '10:42:27', 29, 7, 2019, 'paddy crop  grow in organic method', NULL, NULL, NULL, '2', '5', '', '', '<p><span style=\"color: rgb(69, 69, 69); font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br></span></p><p><span style=\"color: rgb(69, 69, 69); font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br></span></p><p><b><span style=\"color: rgb(69, 69, 69); font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Rice is the seed of a grass variety called&nbsp;</span><em style=\"border: 0px; font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(69, 69, 69);\">Oryza sativa</em><span style=\"color: rgb(69, 69, 69); font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">&nbsp;and&nbsp;</span><em style=\"border: 0px; font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(69, 69, 69);\">Oryza glaberrima</em><span style=\"color: rgb(69, 69, 69); font-family: Raleway, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">. Paddy plant has a fibrous root with the plant growing upto 6 feet tall. It has a round jointed stem with leaves being long and pointed. The edible seeds which are sold commercially as rice grow on the top in the form of separate stalks. Technically this is called paddy as the seeds are covered with a brown colored husk. The paddy is then harvested and dehusked resulting in the commercially important rice. Often people confuse rice and paddy. Rice fields are also called as paddy fields.</span></b><div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n</p>', '1', 'farmke.jpg', '1', '1564377147'