(90, '2019-08-13', '17:27:49', 13, 8, 2019, 'Success Story of  Brown Top Millets  ', NULL, NULL, NULL, '2', '8', '354', '21934', ' \r\n      <div style=\"width:100%;\" id=\"datac\">\r\n        <!-- <input type=\"\" name=\"i_editt\" value=\"<p>Success Story of Brown Top Millets</p><p>  \r\n	<div style=\"width:100%;\" id=\"datac\">\r\n\r\n</div>\r\n	\r\n</p>\"></input> -->&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Success Story of&nbsp; Brown Top Millets&nbsp;</div><div style=\"width:100%;\" id=\"datac\">&nbsp; &nbsp;One of the farmer name is&nbsp; sridharbabu .. this farmer&nbsp; farm the browntop millets in 5 acres&nbsp; in prakasham district . chimakurthi mandal village&nbsp; eluruvaripalem. he is browntop millets farme in tillage method in rabi season. he get good profit in this crop .</div><div style=\"width:100%;\" id=\"datac\"><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">&nbsp;Crop details:</p><p class=\"MsoNormal\">Brown tap Millet in 5 ekar<br></p><p class=\"MsoNormal\"><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Crop duration 80 - 90 days <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">Hilelding 8-10quntal per ekar <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">sowing time may to February (depending on the weather) <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><br></p></div><div style=\"width:100%;\" id=\"datac\">  \r\n	\r\n\r\n\r\n	\r\n      </div>\r\n  ', '1', 'berown.jpg', '1', '1565697469', 'Success_Stories', NULL, '', 'Admin', '1'),
