 acres thai guava contract farming at hyderabad in telangana state ...4 month old crop flowering start ... crop condition is good .... our company greenrichindia agro tech farms management team good support to our farmer .This is a contract farming company greenrichindia agro tech farms. our company doing contract farming like fruits,vegetables and woods crops also . we will provide loan on the plant cost. subsidy ,internal crop seed or plants and product marketing .. the farmer and company agreement up to 5 years . If any one interested in this contract farming Thai Guava best yielding and profitable crop. contact number .: 08914800965www.greenrichindia.com  \r\n	\r\n\r\n\r\n	\r\n      </div>\r\n  ', '1', '4a44aa54-d942-449e-9615-081eeb72c5cc (1).jpg', '1', '1567490018', 'Industry_News', NULL, '', 'Admin', '1'),
